                            "post_text_content": "August 14, 2009 | Tags: Uncategorized “Kelly Clarkson is on the cover of the September 2009 issue of Self Magazine . There’s a bit of controversy surrounding the cover pic where critics are saying the photo was overly photoshopped and does not reflect her current weight. Self Magazine is fighting back saying they treated the photo with the usual retouching they provide for every star.” Now let’s discuss. I wouldn’t call this a ‘scandal’ like everyone else, more like a disappointment. I’m appalled that a magazine entitled SELF would literally erase parts of a person’s body in order to make her to look ‘better’ in their eyes and, in return, sell more issues. I would actually feel more compelled to buy the magazine, seeing Kelly in her actual figure since it resembles a confident woman. Listen, we feel like everyone is ignoring what matters here. The girl is healthy. She is not morbidly obese. She is a talented, empowering female who loves her curves. Self magazine, we’re disappointed. Greatly… *Images courtesy of dailystab.com and examiner.com . Graphics courtesy of Chic Intuition LLC.",
