                            "post_text_content": "April 28, 2010 | Tags: Ask Chic , Celeb Chic Chic Reader Paige writes: “Hey girls, need your help! I came across this photo of Alessandra at Coachella and I’m in love with her boots! Do you know who’s they are, or some similar boots at a reasonable price? Thanks so much!” So that fact that it took us all of 2 seconds to recognize her boots can either mean A ) We’re just that good or B ) We do too much online browsing/shopping which isn’t good for our health. We’ll choose to go with option A and get on with it…Her boots are by Frye ( the pull-on tabs were a huge giveaway ), and they’re called the Carson Pull On Boot . They come in so many colors, and retail for $347. If you’re not willing to dig that deep into your wallet, then why not try these Franco Sarto boots for $106? Or you can get an even cheaper version with these delia*s boots. Finally how about donning western boots from a designer that hails from The South herself, Jessica Simpson. We’re guessing they’d do the job just fine. Happy Shopping! *Images courtesy of their respective links. Graphics courtesy of Chic Intuition LLC.",
