                            "post_text_content": "October 14, 2008 | Tags: Chic Picks So remember back in August when I was questioning the Boyfriend Jeans look? Let’s just say I’m not questioning them anymore… I am officially IN LOVE with Boyfriend Jeans! How you may ask? Well it’s an interesting story. Yesterday I spent the day cleaning up my bedroom which was suffering from a major case of clothing explosion generated by me and my husband’s inability to take two steps towards our closet and hang up our clothes! So I happened to stumble upon a pair of my hubby’s jeans during this process and something possessed me to try them on. Well I did, then added a stretchy belt with a buckle made of two snakes intertwined, tucked in a white tank, threw on a deep purple coccoon cardi, and slipped into some heels. The effect was amazing and the pants were soooooooo comfy (skinny jeans are so binding in comparison)! The only problem though was that his jeans were a bit too big so I decided that I needed a pair of my own and preferably made for women since men’s pants look too drop crotch for my own comfort. It looks like I’m getting the same Current Elliot pair that I so unsurely blogged about two months ago which I find pretty ironic. What about you guys, have you changed your minds about BF jeans? *Images courtesy of justjared.com and their respective links. Graphics courtesy of Chic Intuition Inc.",
