                "domain_name": "<chicintuition><Chic_Under_></Chic_Under_>$...>\n            <post_url>http://www.chicintuition.com/?p=4131</post_url><title>Hot Rings Under $100</title><post_timestamp_parsed>2009/07/24</post_timestamp_parsed><post_timestamp_unparsed>July 24, 2009 </post_timestamp_unparsed><image_urlstype=\"array\" type=\"array\"><image_url>http://www.chicintuition.com/wp-content/uploads/2009/07/rings-under-100.JPG</image_url></image_urls><post_text_content>July 24, 2009 | Tags: Chic Under $... I don’t know if you guys may have already noticed, but I L.O.V.E bling! In my opinion, one should invest, invest, invest when it comes to jewelry because it always takes your look a notch or two higher. My piece of choice? Why the statement ring of course! Something about a big stone or thick stack on my hands makes me feel instantly stylish. On a day like any other, as I did my daily online window shopping, I happened to stumble upon the jewelry section at Shopbop and let me say they’ve gone all out! The pieces are spectacular and I am really digging their rings. Check out my fave picks under $100. Clockwise from top left: Alex and Ani Holly Vintage Bohemian Cocktail Ring $58 Elizabeth and James Snake Stack Ring $55 DANNIJO Jacinda Rose Gold Ring $84 Gorjana Ashby Ring Set $88 Kenneth Jay Lane Bird Ring $88</post_text_content><commentstype=\"array\" type=\"array\"><comment><Text>Love a great cocktail ring- especially one that is Vintage! FYI I have purchased several Vintage cocktail rings from http://www.LauraJamesJewelry.com. They are adjustable(!) so you can move them on different fingers or give as gifts without having to worry if they will fit. Their prices range from $50 to $150 so very reasonable for Vintage!</Text><Timestamp_parsed>2010/11/30</Timestamp_parsed><Timestamp_unparsed>Ella on\n\t\t\t\t\t\tNovember 30th, 2010 10:26 am \n\t\t\t\n\t\t\tLove a great cocktail ring- especially one that is Vintage! FYI I have purchased several Vintage cocktail rings from http://www.LauraJamesJewelry.com. They are adjustable(!) so you can move them on different fingers or give as gifts without having to worry if they will fit. Their prices range from $50 to $150 so very reasonable for Vintage!</Timestamp_unparsed></comment></comments></chicintuition>$...>"
