                            "post_url": "http://www.chicintuition.com/?p=2156",
                            "title": "Chic Interview: It’s Her Factory",
                            "post_timestamp_parsed": "2008/09/02",
                            "post_timestamp_unparsed": "September 2, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/09/its-her-factory-interview.jpg"],
                            "post_text_content": "September 2, 2008 | Tags: Chic Interview Her beauty isn’t her only appeal. It’s the quirky comments, lovely video posts, and constant updates of model searches vs college term papers that make her blog so interesting and addictive. Twenty-two year old Laurel from It’s Her Factory isn’t your normal chick from Nevada, as you can probably tell by now, and that’s why we just had to interview her. Read on… Chic Intuition: Let’s get the obvious question out of the way first. You’re an aspiring model, currently finishing her college degree. What got you hooked on to the fashion world? Laurel: Well, I see the fashion as just another way of self expression – as cliché as that sounds. The industry, (along with trend and design) is constantly changing. I like the idea of being part of that, in some small way and contributing your daily style to the larger world of fashion! Chic Intuition: Is your aspiration for a career in fashion what fueled the start of a blog? Laurel: Not really, I was interested in what all of these bloggers are doing to show the world what their idea of fashion is, what inspires them and keeps them going. Starting It’s Her Factory has actually opened up my eyes to everything from modeling (crosses fingers!) to even the idea of a career in writing or technology. I think a blog can really help a person to figure out their interests and just learn more from each other. Chic Intuition: Ok scenario: you have an unlimited budget to purchase just ONE accessory. What would it be and why? Laurel: Oh dear god, I would freak if I was really given this question. So hard to decide! I would probably go with an Yves Saint Laurent Downtown Tote in black leather. Simple and timeless. Or maybe a Givenchy? Gah! My head hurts, next! Chic Intuition: How would you define your style? Is it constant or do you rotate with the trends of the season? Laurel: It tends to remain pretty constant, but when fall comes around I do get more into ‘chunky’ mode – boots, knits, coats & scarves. My wardrobe also gets a bit darker with the seasons’ turn, I love shades over color for fall/winter. Chic Intuition: Which designer are you currently digging? Laurel: Adoring designs coming out of Denmark like Ivan Grundhal, and Bruuns Bazaar. I’ve got a thing for ‘darker’ designing like Rad Hourani and Martin Margiela, too. Such great textures and structure you don’t get to see everyday. Chic Intuition: Agyness Deyn: overrated or underappreciated? Laurel: Overrated by a longshot. I think she is a phenomenal model, but she has been in the mainstream spotlight for WAY too long now. Chic Intuition: Philosophical question time: How long is too long? Laurel: Calf-length and Aggy’s career. *Images courtesy of itslasfactory.blogspot.com and cmiper.com . Graphics courtesy of Chic Intuition Inc.",
