                            "post_text_content": "May 12, 2010 | Tags: Chic Picks , Street Chic Looking at this picture made me crave one thing immensely- summer stripes! I find it funny that among a Chanel bag, leather high waist pants, and bright red nails, the striped top is what caught my precious eye. Naturally, I went on the hunt to find my own striped pieces for summer. Check ’em! 1. Tory Burch Magnus Striped Cotton-Knit Jacket 2. Thread Social Breton-Striped Jersey and Silk Dress 3. Jimmy Choo Megan Zebra Sandals 4. Maje Twist Striped Lace Top *Image courtesy of jakandjil.com . Graphics courtesy of Chic Intuition LLC.",
