                            "title": "Marion Cotillard Makeup Chic",
                            "post_timestamp_parsed": "2009/07/03",
                            "post_timestamp_unparsed": "July 3, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/07/marion-cotillard-makeup-chic.jpg"],
                            "post_text_content": "July 3, 2009 | Tags: Celeb Chic 1. Apply some kind-a gorgeous foundation faker all over face and neck. 2. Using the smokin’ eyes kit , brush pink highlight shadow all over your eyelids. Next, using the pewter base shadow, apply color from upper lashline to browbone and along the lower lashline. Using the charcoal shadow, start at the outer corner of your lid and blend halfway inwards then out. Take the smokin’ liner and line upper lashes from the outer corner in and lower lashes from the outer corner to three quarters of the way in. Trace over liner, with the charcoal shadow. Apply eye bright to the inner corner of your eye and right below the brow. Lastly, use brow zings wax to define brow. 3. Generously brush BADgal lash black mascara onto upper and lower lashes. 4. Use a fluffy blush brush to apply CORALista blush onto the apples of your cheeks. 5. Gloss your lips with lip gloss – I’m with the band . *Image courtesy of justjared.com . Graphics courtesy of Chic Intuition LLC.",
