                            "post_text_content": "September 2, 2008 | Tags: Not Chic , Real Life Chic It’s been a while since major label Christian Dior has rolled out a knocker of a handbag. Remember the hype with the saddle-bag in ’00? I remember purchasing mine at the Dior boutique in Paris, and the store was packed with fashionistas trying to snag one!! Well, that memory seems to have faded away into my mental file cabinet with label “ past trends ” stamped on. I’ve been quietly rooting for the label to come out with an “it” bag for a while now, but seems like MJ, YSL, and Miu Miu keep coming out with hits. And don’t even try mentioning the ever-lasting Chanel classics. Dior, I’m taking this moment to make a public plea: redeem yourself! We loved you then, and we’ll love you now (if you just take the time to make something we would want to spend major mula on, and wear on a daily basis). *Images courtesy of echicas.net . Graphics courtesy of Chic Intuition Inc.",
