                            "post_text_content": "October 5, 2009 | Tags: Chic Obsessions StyleQ is the new daily destination to learn about fashion from the very people who set the trends: celebrity stylists. When visiting StyleQ you literally have the chance to be styled merely by purchasing the pieces they have for sale. Why? Because those pieces are personally selected and styled to perfection by a different well-known stylist every few months and they started with Monica Rose (one of our faves). Her choices bring you every little bit closer to achieving the looks of Catt Sadler and the Kardashian sisters with a plethora of amazing blazers, gorgeous blouses, and statement jewelry galore. We spoke to the big people behind StyleQ telling them how much we think our readers would love their vision and the pieces they have for sale and they gave us an amazing discount exclusive to Chic Intuition. Use code CHIC60 to get 60% off the entire site plus free shipping! I think I’m gonna head over there right now to beat the online crowds! Oh and be on the lookout November 4, 2009 when StyleQ completely re-launches with a new assortment, profiling Eva Longoria, Scarlett Johannson, Rihanna, and featuring two hugely popular fashion-inspired TV shows that they can’t mention yet. The only hint they could give was that one of them involves a sexy housewife who lives in a big city. Got any guesses?",
