                            "post_text_content": "March 28, 2009 | Tags: Celeb Chic A couple of days ago we posted a review on MTV’s latest show: House of Style. Though we weren’t big fans of Bar Rafaeli hosting, the segment that stuck in our heads was mystical designer Erin Fetherston’s dinner party. MTV featured Erin hosting an intimate dinner party for 8 at her Tribeca apartment in celebration of her Fall 2009 Collection for her friends and muses who helped inspire the collection. Guests included Chanel Iman, photographer Ellen von Unwerth, Sarah Sophie Flicker, Kate Schelter and model Ingrid Sophie Schram. All of the guests had a specific dresscode, Erin’s Fall Collection of course! In addition, we loved the setting, quirky mask headbands, and Erin’s apartment. Take a look at some lovely snapshots of the event, maybe you’ll be inspired to host a fairytale soiree with friends! *Images courtesy of bpcm.com. Graphics courtesy of Chic Intuition Inc.",
