                            "post_text_content": "March 8, 2010 | Tags: Chic Poll One of the things we love about Nicole Richie’s jewelry and fashion lines is that they aren’t inspired or copied from other designer pieces but truly a unique expression of her taste. That is until now. We can’t help but notice that these new House of Harlow sandals are a little bit too similar to the Dries van Notens that took the runways by a storm last summer. In her defense, though, we must say that we’re glad she didn’t go the way of some of her peers (ahem ahem Jessica Simpson and Paris Hilton!) and knockoff the sandals completely but that they are maybe a little ‘too inspired’ for our taste. What do you think? Are they eerily the same, or are we insane?",
