                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/05/ask-chic-target-vest.jpg"],
                            "post_text_content": "May 20, 2009 | Tags: Ask Chic Chic Reader Anna writes: “I really like your site – well done! Quick question, what do you plan to wear with your Target vest; the black with silver accents vest that your friend tracked down for you? I bought one last week and am now wondering how to put it together!” Yes, the beloved Tarjay Bandleader Vest à la Balmain, pure genius. What we love about vests is the fact that they’re probably one of the most versatile pieces to have in a wardrobe. What we recommend for this specific vest, is to tone down the harshness of the black and metal with elements of, shall we say, girly-ness. Try pairing it with a floral dress, or for a more casual look you can go for a bohemian blouse and shorts. Finally, another way to wear it would be to follow Kim Kardashian’s lead and go with J Brand’s thrashed jeans , and a simple tank. Good Luck! *Images courtesy of fadedyouthblog .com, target.com and net-a-porter.com . Graphics courtesy of Chic Intuition LLC.",
