                            "post_text_content": "October 15, 2008 | Tags: Celeb Chic , Chic Find I’ve been on a mission for the past couple of weeks. I want to purchase the perfect pair of skinny leather pants for winter. I don’t mean those flimsy AA leggings, that crack and leave crumbs after every wear. I mean either thick leggings (keep me warm) or really skinny leather pants a la Blake Lively. I love the folding effect they have, not too tight/not too loose. I think I finally found a pair (which I’ll probably order one size up) at VS. Yaay! *Images courtesy of victoriassecret.com and justjared.com . Graphics courtesy of Chic Intuition Inc.",
