                            "post_timestamp_unparsed": "April 18, 2010 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2010/04/eugina-kim-for-target.jpg"],
                            "post_text_content": "April 18, 2010 | Tags: Chic Review We’ve always been fans of Kim’s hats, but not of their prices. That is, until now. The Eugenia Kim for Target collection is the first hat launch in a series of limited-time-only accessory designers at Target, featuring a range of hats that are on-trend and functional that fit into any budget. Inspired by Havana, Cuba, the collection includes cloche, fedora, sun-hat, bucket hat, newsboy and pillbox silhouettes using woven and printed fabrics with various embellishments. Her collaboration ranged from $15-$20, a huge difference from her usual $300 and up price range. We love Target! Can’t wait to buy a few for our summer endeavors. *Images courtesy of target.com. Graphics courtesy of Chic Intuition LLC.",
