                            "post_text_content": "October 15, 2009 | Tags: Chic Find Like I said on our Twitter page, I’m currently vacationing in the UK. I’m loving my time here, from checking out the sites to, of course, shopping till my feet feel like they will literally crumble to ashes. One of my fave shopping destinations has obviously been ( is this too cliche? ) Topshop. I know, I know, everyone raves and rumbles on about the high street store, but they literally are telling the truth. Now, don’t get me wrong, the store has some awful, cheap finds, but for the most part there are great alternatives to expensive trends. One of my personal choices in Topshop is their higher end Boutique label. I had to show you guys an item I would’ve otherwise swiped my cursor over online, this Peplum Jacket . In reality, the fit is amazing, nipped right at the waist for a flattering form fitting jacket. Unfortunately, my size was sold out in store and online, so someone live through my fantasy, purchase it for yourself, and tell me what you think. *Image courtesy of topshop.com . Graphics courtesy of Chic Intuition LLC.",
