                            "post_timestamp_parsed": "2008/11/19",
                            "post_timestamp_unparsed": "November 19, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/11/philliplimhair.JPG"],
                            "post_text_content": "November 19, 2008 | Tags: Chic Find So sometimes, only when I’m bored, I like to go back and revisit certain runway shows just to see if there were any details I missed the first time around. Well it happened recently with the Phillip Lim Spring 2009 show and let’s just say I did notice an extra detail or two. This time what caught my attention was the cute side halo/bun do that all the models had going on. This style would be really cute when paired with an ethereal holiday dress. I’m thinking something white and flowy and some very soft makeup. To get the look: 1. Flatiron hair to make it stick straight and add a shine serum to finish. 2. Split hair into two sections in order to make a side part. Make sure one section is significantly larger than the other. 3. Take the larger section of hair and twist and pin to make a slick side bun. 4. Now, take the remaining section of hair and wrap around the head along the nape of the neck and pin ends behind the bun to conceal and VOILA! A look fit for an angel. *Images courtesy of style.com . Graphics courtesy of Chic Intuition Inc.",
