                            "post_text_content": "April 6, 2010 | Tags: Chic Alert The pictures from the House of Harlow Clothing Fall 2010 Collection are in and the verdict is absolutely fabulous! The starlet has decided to abandon the boho-glam direction of the first collection in favor of a more mature, sleeker, and predominately black and white collection. I am loving the fringed collar top, the double breasted vest, and the cape. I also love the styling of the pieces in the Great Gatsby theme lookbook. Also, it’s refreshing to see that the pieces are definitely worth the investment this time around. What do you think, is this collection better than the first? *Images courtesy of instyle.com . Graphics courtesy of Chic Intuition LLC.",
