                            "post_text_content": "January 6, 2009 | Tags: Ask Chic , Cheap Chic Chic Reader Anna writes: “Hello, I really like your website – can you recommend any alternatives for the 3.1 Phillip Lim Equestrian Blazer?? Love the look but it’s bit pricey for my budget. Many thanks.” Hey Anna! We are just as in love with this piece as your are! So in love, as a matter of fact, that we bought it for ourselves and convinced a friend to postpone picking up her kids from school to get the same one. Yes, I know, bad influence but sometimes you gotta do what you gotta do. So anyways, unfortunately despite it’s hotness this blazer is a bit pricey so we understand your need for a similar one at a lower price point… How’s $29.62 for ya? Low enough? Yes it’s true, I found this very similar INC International Concepts Long Belted Vest for that insanely good price. Get it quick though, because I’m sure once the other readers see this they’ll snatch it up right away.",
