                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/09/luisaviaroma.jpg"],
                            "post_text_content": "September 6, 2009 | Tags: Chic Review Have you ever found a good thing and just wanted to keep it to your lil ol’ self? You feel like it’s a goldmine, and you’re the only one allowed to prance around in it. But after a while, it gets a bit lonely, and dark, and you start to feel a tad bit guilty for not spreading the love. A few years back I found the motherload of designer brands online, and no it’s not Net-a-Porter . I honesty l did not mention it to friends and family, and when they saw me carrying my new Balenciaga or those hot D&G shoes and inquired, I simply stated ‘ Oh, I got them online ‘. (Come on, give me some slack, at least I didn’t lie!) I later felt ridiculous (and by later a I mean a few years) and finally broke. I started mentioning the website to my sisters, family and friends, and they instantly fell in love. Now, I am ready to tell YOU. It’s an Italian website by the name of LUISAVIAROMA and it is divine . Need a hot, sold out everywhere else designer item off the runway? They’ve probably got it. Click here and snoop around. Just don’t be as greedy as me, and share it with those deserving. *Image courtesy of luisaviaroma.com.",
