                            "post_text_content": "March 25, 2009 | Tags: Chic Review Today I finally had the time to sit down and watch a new MTV show that aims at “ taking you into the inner santum of the fashion world “. Ya, I’m not digging this brief. First off, what the heck is a Santum?! Sounds like an unflattering body organ if you ask me. Yes, we googled it, and no it’s not a word. So does MTV think that if they create a snazzy word, viewers are actually going to like the show more? Umm, no. We’ll give them the benefit of the doubt, and take that it’s a typo (they probably meant sanctum: An inviolably private place ). We thought we wouldn’t start off by judging the brief, and decided on giving the show a chance. We wish we had judged them. Bar Ravaeli is an amazing model, but an awkward host. It was really hard to follow her choppy sentences. Let. Us. Take. A. Look. At…..you get where we’re going. The ideas for the segments were great, but we felt like they were too many for a 20 minute show. Only part we liked was Erin Featherston’s dinner party (more about that tomorrow). Sigh . Sorry, we might seem a bit harsh but we expected more from MTV. Did any of you catch it? *Images courtesy of mtv.com . Graphics courtesy of Chic Intuition Inc.",
