                            "post_text_content": "September 10, 2008 | Tags: Not Chic We are all for art and the abstract. We love an innovative, intriguing piece of expression. But when we first saw this handbag, we thought it was a joke, as in “ oh hehe what a funky piece of photoshopped work!! Wonder what the artist was trying to convey?? ” Something about poverty, and not enough hands to carry the bag. Or about how society today is hungry for the materialistic, so much so that the artist added excess handles. You know, the usual. Readers, this is an actual bag. An actual LV handbag, for humans to carry. We swear. Not octopuses, but for humans. Seriously, what…. the…. $%^& *Image courtesy of louisvuitton.com .",
