                            "post_text_content": "March 11, 2009 | Tags: Real Life Chic , Uncategorized I know that this site revolves mainly around style, but what if we spot a stylish girl with a killer pad? We can’t help but mention it, especially since I’m an architect and dabble in interior design myself. Ever since the start of The City , I’ve been eying the apartments of the stars and have to admit that each and everyone of them either has killer interior taste or some major mula that allows them the convenience of a fab Upper East Side Interior Decorator. Let’s take a look at Exhibit A: Olivia Polermo’s apartment. The secret to her stylish abode is credited towards her interior designer mother and the fact that her trust fund allows her the comfort of unlimited furniture selections; so the girl’s basically working with two advantages. That point aside, we still think that with the right theme and attitude, anyone can create a similar space. Olivia’s apartment has “a 1960s look with a classic, old Hollywood feel”, which we just adore. The fact that her space is retro, means that it’s timeless and thus little Oli will never get bored in its vicinity. Just remember that shopping for furniture is not like shopping for clothes, a trick that Olivia’s mom taught her, “you need to think of the look of the entire apartment.” Touche! *Images courtesy of nypost.com . Graphics courtesy of Chic Intuition Inc.",
