                            "post_text_content": "February 9, 2010 | Tags: Chic Review Ever since that infamous episode of the The Hills where poor Whitney plummets to the ground on live television, I’ve been obsessed with Mr. Andre Leon Talley. He’s so talented, sweet and snarky at the same time. If you’re a fan as well, then you’ll be happy to know that he’s signed on to judge the 14th Season of America’s Next Top Model. Starting March 10, you will be able to watch the editor-at-large for Vogue USA give his opinions as a guest judge; he will take the place of J. Alexander, who will now coach strutting to the models. How does Talley’s boss, Anna Wintour, feel about his latest gig? “I think his latest adventure sounds like a lot of fun and I look forward to watching him on the program.” Do you agree? *Images courtesy of wwd.com . Graphics courtesy of Chic Intuition LLC.",
