                            "post_text_content": "August 6, 2008 | Tags: Uncategorized a froggie! I used to love frogs. There was a little pond ( ok not a pond, but a hole with water in it ) near our backyard, and we used to catch the tiny baby frogs and giggle as they jumped up and off our palms. Memories. Now that I think of it, how in the world would I allow myself to touch a frog is beyond me! Anyways, it seems like Mr. Jacobs likes frogs as well. The inspiration for the clasp on this bag is just divine, and I’m loving the orang ish red. We first posted on the wristlet version of this bag that Fergie was seen carrying. Honestly, I love this larger version more, and unfortunately it’s not available anywhere online. For those of you wondering, the bag is my cousin’s and the photo was taken by my sister who’s just started dabbling in photography.",
