                            "post_text_content": "August 17, 2009 | Tags: Celeb Chic , Not Chic Taking two designer dresses, mixing and matching between them to create the following in order to avoid a lawsuit, we think not cool. Try again next time Asos… *Images courtesy of zimibio.com and asos.com . Graphics courtesy of Chic Intuition LLC.",
