                            "post_text_content": "September 23, 2011 | Tags: Ask Chic Chic Reader Bridget wrote: ” I have recently bought a new white lace maxi skirt. It has no lining so I have to wear white bike shorts underneath- not so chic. Please help me find a fun stylish top I could wear with this skirt to get an idea as to what colour and style I should be looking at.” We’d like to applaud your great fashion insight since translucent maxi skirts are very in this season Bridget. Your choice of wearing biker shorts is unique, and we’d also recommend trying a pencil skirt underneath as well. Concerning what to wear with your lace skirt, the best part about this item is that you can either dress it up or down. Why not try a loose button down denim shirt for mornings out with a pair of sandals, and then take the look to the next level with a sequined blazer and pumps? Either way, we guarantee you’ll look smashing. Good luck! *Images courtesy of shopbop.com and net-a-porter.com. Graphics courtesy of Chic Intuition LLC.",
