                            "post_text_content": "July 21, 2008 | Tags: Chic Interview Meet the stunning Carolina Engman. She’s a 21 year old stylist who lives in Sweden, and blogs to our heart’s content. Her array of poses combined with ethereal photography and, of course, sensational outfits is what keeps us browsing Fashion Squad on a daily basis. Consider this interview a free styling session! Enjoy loves! Chic Intuition: Usually people get attracted to certain blogs based on the content, concept, or inspirational images. To be honest, (no matter how superficial this sounds) we were attracted to your beauty. Talk about model material! Do you ever think about modeling? Carolina: I’m very flattered, but no. Modeling is not for me, I rather lurk around behind the scenes. Chic Intuition: I was discussing this with my co-editor the other day, I’m actually contemplating a trip to Sweden based on the stylish senses of all the Swedish blogs!! Please tell me that not ALL of the Swedes dress this good. There has to be SOME fashion no nos, no? Carolina: People in Sweden are over all quite well dressed, but no worries, we do have a lot of fashion roadkills too! 😉 Chic Intuition: The photography used in your blog is just exquisite. It speaks all languages. Who takes the pictures for you, and what camera do they use? Carolina: Thank you very much! I actually take most of the pictures myself with a self-timer and I use a Canon eos 350d with a 17-55 mm lens from Tamron. Chic Intuition: What we gather from your writings is that you’re a stylist. For those interested, can you brief us on a typical day on the job? Carolina: I work as a freelance stylist so I don’t have a 9 to 5 job. Working as a stylist equals really long days, lot’s of heavy stuff to carry around and being poorly paid, so you need to be really passionate about fashion. But you also get to meet lot’s of inspiring people and I absolutely love my job. Chic Intuition: When did you finally nailed your personal style? Do you feel like it might evolve fashion-wise later on? Carolina: God yes, my style has been evolving since I was just a kid and it will probably keep on doing so for the rest of my life. Chic Intuition: If you were forced to live with just ONE accessory for the rest of your life, what would you choose and why? Carolina: My hat! perfect for bad hairdays or when I just want to be a little mystical, haha! Chic Intuition: Contemplation of the day: how baggy is too baggy? Carolina: A little baggy is ok, but when you trip and fall because of your baggy pants, it’s a major sign that it’s time to get a belt. *Images courtesy of fashionsquad.com . Graphics courtesy of Chic Intuition Inc.",
