                            "post_text_content": "December 31, 2008 | Tags: Chic Find , Chic Tips So now that the holidays are over, we know more than a few of us have added on a couple of pounds. When your fave pair of jeans is a bit too snug for comfort, you have 2 choices: to loose the pounds ( ha! easier said than done ) or to hide them in the back of your closet (we’re talking about your jeans, not the extra weight). Hold up, we here at Chic Intuition have actually seemed to find another solution, where you can lose the weight on your own time frame ( aka food poisoning ) and keep wearing your fave denim! How you may ask? Well we were browsing one of our fave blogs , remember Carolina who we interviewed a while back, we loved this image of her in these rockin’ leather lined jeans, and a light bulb went off. DIY project! So if you have any pairs of pants that you’d like to make grunge chic, here’s your answer. I’m actually dropping my pair off at the seamstress now (weight gain and laziness come hand in hand with me) ! *Image courtesy of fashionsquad.com . Graphics courtesy of Chic Intuition Inc.",
