                            "post_text_content": "January 15, 2009 | Tags: Celeb Chic So I have an embarrassing confession to make. Actually they’re two confessions. The first is that I watch every episode of The City twice. Why? Well the first time is basically to grasp the drama, events, and ogle Jay. And the second time around I love to just focus on the fashions. You really do notice much more the 2nd time around, like the fact that most of Whitney and Olivia’s wardrobe is from DVF. Now my second, and even more plaguing declaration is that I’ve started to copy a trend I’ve caught Whitney doing: let’s call it the adjacent rings trend. Episode after episode, I found that she loves to wear two rings on her left hand, but unlike most of us out there who’d choose to adorn our index and ring fingers, she wears them on her index and middle finger. Ok, I think this is borderline stalker- ish , but I took the liberty of saving some frame shots for you ladies. I have to admit, once you try it, it’s kind of addictive. Ok, phew, feel like a weight has been lifted off my shoulders. Maybe I should confess about finishing the rocky road choco chip cookies to my sisters? Oops, I kind of just did. *Images courtesy of mtv.com . Graphics courteys of Chic Intuition Inc.",
