                            "post_timestamp_parsed": "2008/08/09",
                            "post_timestamp_unparsed": "August 9, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/08/leighton-meester-bronzer.jpg"],
                            "post_text_content": "August 9, 2008 | Tags: Celeb Chic , Chic Picks We here at Chic Intuition have had our fair share of bronzer mis-haps. Whether we’d end up looking streaked and tweaked or oven-baked burnt, we’ve finally been able to out a bad (or good) bronzer. For beginners, we’d recommend dealing with the powdered type of shimmer. This enables you to highlight the areas of focus, and simultaneously darken your features as you go. Cream bronzers, on the other hand, are quite tricky to maneuver. Most people squeeze the cream on their hands, and apply with fingers or a brush. After a couple of sweeps, they’ll notice that their hands have turned the color of an orange mirangue pie. Don’t forget how sometimes creams can create lines and patches for those bronzer virgins out there! This post was inspired by this image of a flawless Leighton Meester. The fresh faced bronzed beauty clearly knows what works for her, and in this case it’s shine and sheen. Since we don’t know the level of of bronzer application expertise of our Chic Readers, we decided to start out easy with our top 5 powder picks: NARS Blush/Bronzer Duo Guerlain Terracota Bronzing Powder Lancome Star Bronzer Laura Mercier Mosaic Shimmer Block Cargo Beach Blush *Images courtesy of justjared.com and sephora.com. Graphics courtesy of Chic Intuition Inc.",
