                            "post_timestamp_unparsed": "February 11, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/02/michelle-obama-vogue-cover.jpg"],
                            "post_text_content": "February 11, 2009 | Tags: Not Chic The first image of Mrs President have finally surfaced, and we’re a bit… blah -ed out. We were so excited to hear that the First Lady was to cover our most coveted magazine, and imagined the endless possibilities of her glammed up. But when we took a look at her in a plain magenta dress, we were a bit disappointed. Havn’t we seen this look and that hair all too much? I don’t know, maybe it’s our mental association with Vogue and all things uber glamorous that got the best of us. What do you think, would you like to have seen her made over? *Image courtesy of Today/MSNBC . Graphics courtesy of Chic Intuition Inc.",
                            "comments": [{
                                "Text": "DRAB. seriously? just because she’s mrs. president doesn’t make fashion fabulous-ness a no-no!",
                                "Timestamp_parsed": "2009/02/11",
                                "Timestamp_unparsed": "Lulu on\n\t\t\t\t\t\tFebruary 11th, 2009 10:27 am \n\t\t\t\n\t\t\tDRAB.\nseriously?\njust because she’s mrs. president doesn’t make fashion fabulous-ness a no-no!"
                            }, {
                                "Text": "I was expecting more glamour too, when I heard the news yesterday that she was going to be on Vogue. I’m slightly disappointed, but I will say that she looks gorgeous. There is something very timeless about the picture they choose, regardless if it’s “glamorous” or not.",
                                "Timestamp_parsed": "2009/02/11",
                                "Timestamp_unparsed": "apricot tea. on\n\t\t\t\t\t\tFebruary 11th, 2009 1:07 pm \n\t\t\t\n\t\t\tI was expecting more glamour too, when I heard the news yesterday that she was going to be on Vogue. I’m slightly disappointed, but I will say that she looks gorgeous. There is something very timeless about the picture they choose, regardless if it’s “glamorous” or not."
                            }, {
                                "Text": "DRAB…they could have added some bracelets or a fun necklace at least.",
                                "Timestamp_parsed": "2009/02/11",
                                "Timestamp_unparsed": "jill on\n\t\t\t\t\t\tFebruary 11th, 2009 4:34 pm \n\t\t\t\n\t\t\tDRAB…they could have added some bracelets or a fun necklace at least."
                            }, {
                                "Text": "drab! she’s wearing the standard first lady uniform for the cover… she has made some more interesting choices when her husband was running for president so the vogue stylists could definitely have some risky choices… then again, as a first lady she has to look politically correct so they are at a difficult positon; but i still think they could have figured out a more interesting outfit and photo and still look politically correct",
                                "Timestamp_parsed": "2009/02/11",
                                "Timestamp_unparsed": "cattirun on\n\t\t\t\t\t\tFebruary 11th, 2009 5:20 pm \n\t\t\t\n\t\t\tdrab! she’s wearing the standard first lady uniform for the cover… she has made some more interesting choices when her husband was running for president so the vogue stylists could definitely have some risky choices… then again, as a first lady she has to look politically correct so they are at a difficult positon; but i still think they could have figured out a more interesting outfit and photo and still look politically correct"
                            }, {
                                "Text": "So Drab. She could have at least worn a gown!",
                                "Timestamp_parsed": "2009/02/12",
                                "Timestamp_unparsed": "Dee on\n\t\t\t\t\t\tFebruary 12th, 2009 1:39 am \n\t\t\t\n\t\t\tSo Drab.\nShe could have at least worn a gown!"
                            }, {
                                "Text": "it’s 100 % her people controlling the cover shoot. think about the bigger context. she can’t look too fabulous/high fashion/accessorized when the country is sinking into a deep depression. when unemployment numbers are higher than they have been in four decades. it’s all about representing restraint. similar to the 90s minimalism backlash to the 80s excess.",
                                "Timestamp_parsed": "2009/02/12",
                                "Timestamp_unparsed": "Diabolina on\n\t\t\t\t\t\tFebruary 12th, 2009 1:44 pm \n\t\t\t\n\t\t\tit’s 100 % her people controlling the cover shoot.  think about the bigger context. she can’t look too fabulous/high fashion/accessorized when the country is sinking into a deep depression.  when unemployment numbers are higher than they have been in four decades.  it’s all about representing restraint.  similar to the 90s minimalism backlash to the 80s excess."
                            }]
