                            "post_text_content": "March 15, 2009 | Tags: Chic Find Lately, I’ve been trying to finish my summer season shopping ahead of time since the deals are too good to pass up. So far I’ve been quite successful and must say I’m proud of myself. Anyways, while on this mission I happened to check out my local Zara and lo and behold I found the crystal studded Balmain-inspired sandals that no one on the blogosphere is currently able to get. Apparently Zara stopped making them due to a stern warning from Balmain (well that’s the story going around in any case)! Well I’m happy to say I scored the last two pairs they had but unfortunately when I got home they didn’t fit my feet So I was thinking of returning them and then I thought why not help a hopeless fashionista or two out there who didn’t happen to get their hands on their own pair? So here goes, I am selling two pairs of these sandals in a size 40 Eur, 9 USA, and 7 UK. They are both brand new and never worn and one even has a plastic protectant cover on the soles. I must say these babies are very high quality and the studding and crystal detail are not in any way flimsy. After looking up their pricing on Ebay ($450-$599), I’ve listed them here for $350 and free shipping to anywhere in the U.S. (for international a flat rate of $35 with insurance will apply). Good luck!",
