                            "title": "Chic Interview: My Fash Diary",
                            "post_timestamp_parsed": "2011/01/12",
                            "post_timestamp_unparsed": "January 12, 2011 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2011/01/my-fash-diary-interview-tala-samman.jpg"],
                            "post_text_content": "January 12, 2011 | Tags: Chic Interview We’re totally enthralled by our latest Chic Interviewee, she has a wardrobe that makes some of the most stylish girls die of envy. Twenty-year-old Tala Samman of MyFashDiary is a Syrian who was born in the USA, grew up in Dubai, and now lives in London, talk about major globe trotting! Keep a close eye on this fashion student, we’re sure she’ll be making her mark on the Fashion World in the near future… Chic Intuition: What drew us to your blog was two things Tala, your undeniable beauty and your nationality. It’s so refreshing (and rare) to see an Arab fashionista run a blog. Tell us how you started. Tala: Thank you! I’m flattered. I have been a fan of blogs for quite a while (a long way before the whole blogging craze begun) I wanted to start my own to share my love for fashion and document my exciting fashion experiences but needed to find the right time for the commitment. Chic Intuition: Anyone who follows My Fash Diary knows that you have your place in the fashion industry. Your mother is the face of Nina Ricci in the Middle East. Do you have any plans to represent a brand in the future? Tala: Never say Never! Chic Intuition: Complete this sentence: “My proudest moment in fashion was….” Tala: “getting assigned a front row seat at Chanel SS11 show in Paris.” Chic Intuition: How surreal was it to meet Christian Louboutin? Did he live up to his God’s gift to women everywhere status?! Tala: He is such an interesting and talented man, and very down to earth! Chic Intuition: Philosophical Q time: How flared is too flared? Tala: When you start resembling a clown… *Images courtesy of myfashdiary.blogspot.com . Graphics courtesy of Chic Intuition LLC.",
