                            "post_text_content": "September 19, 2009 | Tags: Chic Review It’s hard to imagine that Fred Astaire could be a muse behind a female fashion line, but Mr. Mizrahi ( or as we like to call him, Mr. Magic ) made it happen. His latest presentation entitled Astaire Case or Obstacle Course , was based around feminizing 50s menswear elements. We honestly loved every single piece in this collection. From the color palette to the beautifully sewn light floral detailing, nothing went missing. To top it all off, were the amazing accessories ranging from oxfords to top hats. The extravagant designer took his collection a step ahead of what we’ve grown so tired of seeing, grunge and filth. Thanks Mr. Magic for reminding us that fashion should have some beauty incorporated. *Images courtesy of style.com . Graphics courtesy of Chic Intuition LLC.",
