                            "post_text_content": "November 18, 2008 | Tags: Street Chic Winter is coming and I’m so excited! Even though I look forward to summer, there’s something about winter style that I love. I don’t know what it is exactly but I think it has something to do with the ability to layer, boots, and the fact that winter clothing just looks more elegant. Well today I was at The Grove having dinner and walking around and finally felt the beginning of the winter season. I even ran into Stacy Keibler (umm can I say legs for MILES) and her boyfriend Geoff Stults and they looked like they were also feeling the winter chill. Since I couldn’t snap pics of their street style, I decided to search for some street looks online for the perfect transitional outfits. Check them out below and get inspired people! Warning: These looks are recommended for California winters! For you other guys with snowy weather, make sure to add a few more layers. We will not be held responsible for you freezing your butts off! *Images courtesy of elle.com . Graphics courtesy of Chic Intuition Inc .",
