                            "post_text_content": "August 12, 2008 | Tags: Ask Chic Chic Reader Elysia asks: “Hey! I love your blog so much- the personality is really fun and you have great style. Anyways, I am in love with almost every Frye boot, but I don’t want to spend $400. Do you know of any good (cheap) look-a-likes to any of their riding boots? I especially love the Campus 12R in Saddle, but I could totally go for anything :)” Wow, what a fun challenge! We went on the quest for the quintessential look for less, and have to admit that there are a ton of options for not only a $100, but for less than $50! We don’t know if it’s the economy or the fact that designers out there are sympathizing with frugal fashionistas, but we love it either way. Personally we are huge fans of Frye boots, and think that they are a great investment for those of you out there that want a long term relationship with a wearable riding boot. But for those of you seeking a fashionable fling with the trend, then we recommend following Elysia’s lead and looking for a less costly version. We’ve compiled a list of our faves under $100, and have to admit that all this research has got us aching for some cold weather wear! Fitswell Sandusky $ 89.10 ALLOY Moto Boot $49.50 ASOS Buckle Detail Low Biker Boots $67 Delia*s Mackenzie Boot $89.50 Timberland Women’s Flora Tall Boot $98.97 *Images courtesy of revolveclothing.com and their respective links. Graphics courtesy of Chic Intuition Inc.",
