                            "post_text_content": "November 3, 2009 | Tags: Gossip Girl Chic While last season was obviously Blair’s in terms of eye-catching fashion, this season Miss Serena van der Woodsen is back on top. In comparison to Blair’s super preppy and kinda blah outfits, Serena doesn’t cease to wow us with her amazing fashion episode after episode. It could be that the working girl in her was just waiting to shine, or that this season her confidence is sky high. Whatever it is it sure is working! Another hot outfit was her gorgeous green party dress from last night’s episode. Paired with a peacock clutch and a high updo Serena really captures all the reasons why we fell in love with her on the first season. Lucky for us, this piece is available and is the Vena Cava Synthesizer Dress . Tune in next week for more GG fashion updates! xoxo, Chic Critic ( Loves it! ) *Image courtesy of gossipgirlinsider.com . Graphics courtesy of Chic Intuition LLC.",
