                            "post_text_content": "August 17, 2008 | Tags: Chic Find I never got that phrase. I kinda think it sounds like an insult when someone uses the word “fartsy” in any way, shape or form in a sentence. Well let me try it. Ladies, and gentlemen (you never know), for those of you out there that consider yourself to be artsy fartsy , well then here’s your chance to prove it for the mere price of $1,300. The Fendi ‘Paint-Your-Own’ Baguette is basically a blank canvas that comes with a set of Ten Pantone Universe markers for you to go wild with. Personally I think the idea is great, but kind of nerve wrecking at the same time. One mistake, and you’re stuck with a $1,300 bag that you won’t want to carry. On the other hand, I think that they’re taking the whole “one of a kind” concept to a whole other level, and I love that. I’d create a plan of action, practice a couple of times, and then set my mark on the bag. What do you guys think? *Image courtesy of eluxury.com , and lifeclever.com . Graphics courtesy of Chic Intuition Inc.",
