                            "post_text_content": "June 19, 2009 | Tags: Real Life Chic Awhile back I decided to throw a Moroccan themed dinner party to celebrate the upcoming nuptials of one of my dear friends. When I offered to throw the party it seemed like an easy feat since my house is already decorated with a Moroccan theme. Lo and behold it was quite a job picking out flowers, table settings, and trying to stay as close to the theme is possible. Even when it came time to building my own Moroccan style low table settings (using unopened banquet tables propped onto coffee tables mind you) I was resilient on making it work using books and what not to provide the much needed balance. All the efforts came to fruition as the party was a smashing success! Even my DIY vase project made with branches, crystals, petite lanterns, and sand was a hit and got a lot of compliments from my friends. Since we know you guys like to get a glimpse of our real chic lives from time to time, I decided to share some pics. Let me know what you think!",
