                            "post_text_content": "April 19, 2009 | Tags: Chic Alert Wow, you know the recession is hitting when almost every large designer label collaborates with a mass marketor to create an affordable line. The latest designer to do so? Rachel Roy. She will be designing a diffusion brand exclusive to Macy’s which includes affordable contemporary sportswear, footwear and accessories. The lower-priced line is dubbed Rachel Rachel Roy and is slated to debut in August 2009 . The line will retail from $59 to $299 for sportswear, $79 to $199 for footwear, $40 to $195 for jewelry and $69 to $109 for handbags. Check out a preview of the items below. Seems like Rachel is taking a totally different take with this line, we are just in awe of the jewelry and studded handbags. Founder and artistic director, Rachel Roy, said, “Accessible fashion has always been a passion of mine. Every woman should have the opportunity to express herself through style. Being able to design a contemporary product line that truly reflects a sense of individuality is a great honor. Macy’s has been an embracing partner in helping us launch this redefinition of a new lifestyle collection.” via WWD *Images courtesy of nitrolicious.com . Graphics courtesy of Chic Intuition Inc.",
