                            "post_text_content": "September 23, 2008 | Tags: Chic Review Yes, it’s a new “ we’re not a reality show ” reality show, and it’s actually affiliated with VOGUE, one of the most prestigious fashion magazines out there. I don’t know, but does anyone else think that they are stooping too low by adhering to the public’s hunger for reality tv? I cringed when I heard that they would be releasing a 14 episode online series… following the lives of models. Cringe further . My fave quote? “ …but I was also like, you know, I’ll go to 4 years of university but, you know I’m like what am I gonna do with my degree? “. I don’t know, maybe have something to fall upon if this whole “reality show” thing doesn’t work? These girls already have representation, so it’s basically a documentary of their introduction into the fashion week world. I found it kind of blah boring. Why not make a documentary on girls struggling to get a deal while balancing numerous jobs to support themselves in major cities? Now that’s reality tv. Check out the first episode below and decide whether you like it or not.",
