                            "post_timestamp_unparsed": "July 24, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/07/forbiddenlove.jpg"],
                            "post_text_content": "July 24, 2008 | Tags: Real Life Chic Have you ever had the feeling that you have to buy a certain item of clothing? You keep thinking about it if you walk away, and can’t rest easily until you’ve purchased it. You’ll go to any amount of stress, and create any necessary mess, just to get your hands on that piece, and actually say you own it. You dream about it. You dream about wearing it. You dream about wearing it and going out in it. The dreams are endless, until you finally buy it. It’s in your hands, you feel fulfilled. You head on home, run to your room and try it on in front of that huge mirror. You take one look at yourself and go………..",
