                            "post_text_content": "August 14, 2008 | Tags: Chic Review Her designs, reminiscent of the Royal Courts of India, are a mix of traditional elements and modern aesthetics. Rosena Sammi ‘s jewelry is truly a unique, elegant approach to fine accessories. She started her career path on a rather different note, as an attorney in New York. Her passion for jewelry shone through, and she decided to pursue her dream by attending the Parsons School of Design. Apparently not only do we here at Chic Intuition admire her collections, but so do the stars. Her designs have been donned by the likes of Hillary Duff, Claire Danes, and Naomi Watts. Take a look at some necklaces from her meaningful Kismat Collection , with prices ranging from $110-$230. *Images courtesy of rosenasammi.com and 4to40.com . Graphics courtesy of Chic Intuition Inc.",
