                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2011/10/chokers.jpg"],
                            "post_text_content": "October 12, 2011 | Tags: Chic Obsessions , Chic Picks One of the hottest accessories for this Fall is most definitely the choker necklace. Fashionistas everywhere are using this piece to add a little flare to their looks. Even Rachel Zoe wears a beautiful gold piece on the latest season of The Rachel Zoe Project. We searched high and low for the coolest chokers out there and chose two that we really felt would help you achieve the look. If you are on a budget, we highly recommend this Kenneth Jay Lane Thick Snake Chain Bib Necklace but if you aren’t, please please please splurge on this lovely ANNDRA NEEN Cage Choker . Tell us, are you feeling this trend? *Images courtesy of style.com . Graphics courtesy of Chic Intuition LLC.",
