                            "post_text_content": "July 19, 2009 | Tags: Ask Chic Chic Reader Maria writes: “I’m a huge fan of your blog and I love your style, that’s why I want your help. For a little while by now I have been wanting to redecorate my bedroom but haven’t decided what direction to take. I was wondering if you could give me a hand with some stylish advice and ideas of how a stylish bedroom in your opinion should look. The only thing I have decided is the colors which are hot pink and aqua so maybe you can start with that.” Ooh, I love a good decorating question! We’re always discussing how we feel fashion and design go hand in hand, so here’s our chance to prove it. The great coincidence is that I’m personally in the process of redecorating, and my two colors are quite similar to yours Maria (light turquoise and magenta). So let’s get started with a few tips: Ok Maria, for your room we thought we’d go eclectic chic. We created a color map that we followed, and chose items based on the mix we talked about above. Enjoy! UO Tribal Macrame Trim Rug $58 UO Hourglass Side Table $78 Casual Home Tab-Top Window Panel Pair – Black $16 Thru the Trees Chandelier $30 Pepperminte Bleu Print $18 Anthropologie Flea Market Find Table $298 West Elm Parsons Desk $329 Line Orchids Pillow by Masha D’yans $38 Philippe Starck Victoria Ghost Chair $330 Jonathan Adler Soldier Lamp $346.50 *Images courtesy of their respective links. Graphics courtesy of Chic Intuition LLC.",
