                            "post_text_content": "August 4, 2009 | Tags: Celeb Chic Do you ever spend a lot of time looking for something online and not finding it until after you need it? Well that happened to me today. I was going to a wedding three weeks ago and I really wanted to wear a long-sleeved maxi dress to go with a vintagey look. Well, at the time, I couldn’t find a single one that I liked and today I find one almost instantaneously while trying to recreate this hot look donned by Cate Blanchett. She was out celebrating the 50th anniversary for Vogue and damn she looked good! I tried to find a red hot dress but was unsuccessful and so I decided to go for the general chicness of her look with the T-Bags Drape Sleeve Long Dress , Michael Antonio Women’s Sawyer Platform Sandals , and the Rachel Leigh Jewelry Cleo Teardrop Collar Necklace . Happy Shopping! *Images courtesy of justjared.com . Graphics courtesy of Chic Intuition LLC.",
