                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/01/anne-hathaway-makeup.jpg"],
                            "post_text_content": "January 7, 2009 | Tags: Celeb Chic It’s no surprise seeing Miss Hathaway looking flawless, we’d even go further and say that it’s kind of annoying by now. I mean, can the woman do any wrong? We guess not. Take a look at her here, she manages to pull off the subtly stained lips and barely there blush without a hitch. We’d recommend trying this look for a sweet change from the harsh winter makeup wear. Start off by generously applying Givenchy Prism Foundation to the face and neck area. With the tip of your ring finger, slowly smoothe Benefit Cosmetics Boi-ing Concealer under and around the eye area. With the same finger, dab on the foundation over your eyelid from crease to brow line. Use a round-tip eyeliner brush to sweep Bare Escentuals bareMinerals Liner Shadow along the upper and lower lashlines. Blend. Apply Givenchy Phenomen’Eyes Mascara to upper and lower lashes. Repeat numerous times till lashes have reached required thickness. Dab on Tarte Natural Beauty Cheek Stain on to the apples of your cheeks. Finish off the look by swiping Benefit Cosmetics Benetint Lipbalm and then blotting with a tissue. Voila! *Images courtesy of justjared.com and sephora.com. Graphics courtesy of Chic Intuition Inc.",
