                            "post_text_content": "November 4, 2008 | Tags: Ask Chic Chic reader Sally asks: “Thank you for finding out about the sideways cross necklace that Tay-Tay wears! But do you know where she got her dangling bracelet (that she wears on her wrist next to her gold watch)??? I’ve been searching and searching for that bracelet! I believe its the same one Lauren Conrad, Audrina Patridge, and Nicole Richie have all worn before. Please let me know if you find out!!! Thank you!” Well Sally, we tried squinting and focusing on shots of Taylor from the show (sorry there weren’t any close-ups) but we couldn’t ID it. The good news is that we found similar bracelets, like the 14K Gold-Filled Rope Bracelet by Beth Lauren. It’s 50 inches long, so it can be worn as a necklace too! The bracelet retails for $170, and you can find it here . We are also loving the Jorge Morales Fringe bracelet that you can see here . Happy shopping! *Images courtesy of bravotv.com and their respective links.",
