                            "post_text_content": "November 10, 2008 | Tags: Chic Interview Let’s go on a fab trip Down Under, and visit our latest interviewee, 20 year old Ashleigh. Hailing from Melbourne, this blogger has perfected ‘casual chic’. She’s even credited with coining the term ‘ Wangster ‘ (aka girls who dress in Alexander Wang type outfits). Think a t-shirt + shorts combo is bland? Well you haven’t seen anything till you’ve seen her donning them. The fact that she adds flare to any outfit is what compels us to visit her blog continuously. Take a look at what she had to say. Chic Intuition: We love how the seasons in Melbourne, Australia happen almost at opposite times than the rest of the world. So when we’re snuggling up for winter, you guys are prancing around in your summer clothes. Do you love/hate that? And does it affect your outfit choices? Ashleigh: It is a love-hate relationship. I see what everyone is wearing overseas in the Summer and I start getting inspired and excited about all the wonderful things to wear, but then Fall rolls around and I am completely envious of all the leather, fringing and grunge. I love the fact that I can prepare extra early from the inspiration that I get from all the other bloggers, runways and magazines, but I do hate it because I haven’t found many bloggers in Australia that I can be inspired by for our seasons and relate to in style. I’m really trying to drag out some warmer clothes for as long as possible, for example I just bought the American Apparel lame leggings and we’re almost in Summer weather! Chic Intuition: You study media and communication. Any goals of heading into the fashion realm in the future with your degree? Ashleigh: My course at the moment is a three year course, I’m almost one year down and I have been looking into doing a fashion course afterwards. I’m just not sure where to look or what to do I would love to be a fashion journalist or a stylist. I really want to stay in the fashion realm in some way or another. Chic Intuition: What’s your fave purchase and why? Ashleigh: It’s such an overdone answer but my leather jacket. I don’t even think twice about grabbing it! I think it comes everywhere with me. I bought it earlier this year and I seriously thank myself for buying it everytime I pull it out. It goes with everything! And it certainly toughens up the girlier elements of my wardrobe. Chic Intuition: Hermes Birkin or Chanel 2.55? Ashleigh: Chanel 2.55. I annoy the hell out of my boyfriend about this bag. I think it’s perfectly classic, timeless and completely versatile. It’s just an absolutely beautiful bag. Okay I think I’ve gushed way too much. Chic Intuition: Your blog not only reflects your fashion choices, but you talk about some aspects of your personal life as well. When do you draw the line on what to talk about? Ashleigh: I really enjoy knowing something about the person I’m reading about whether it be on blogs, in magazines or anything. I don’t reveal a whole lot more than just day to day events, such as if I bought something new or what I did during the day. I think it’s nice to be a little personal, it’s more natural, I mean, it is a personal blog aswell as a fashion diary, and this way I don’t appear like a clothes horse robot. Chic Intuition: If you could choose any piece from a designer this season, what would it be? Ashleigh: Well now that Australia is coming into Summer that’s really tough because I would love to buy all the wonderfully warm clothes but that would be a waste for another season. I would really like to keep some rock and roll for Summer so I think I’d have to go with Balmain’s studded sandals. I’d die for them. Chic Intuition: And finally, philosophical q: How ripped is too ripped? Ashleigh: Nothing can ever be too ripped. *Images courtesy of iamashleigh.blogspot.com . Graphics courtesy of Chic Intuition Inc.",
