                            "post_timestamp_parsed": "2008/11/12",
                            "post_timestamp_unparsed": "November 12, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/11/gisele-makeup.jpg"],
                            "post_text_content": "November 12, 2008 | Tags: Celeb Chic In her latest photoshoot, Gisele Bundchen looks amazing (studded vest:hot!), so we decided to give you gals a lesson in the infamous ‘fish-eye’ makeup look. Just keep in mind, this version of the smokey eye should only be worn out at night, or else people might claim you have another type of eyes, raccoon! Start off by covering your whole eyelid with a pressed powder base in a color that matches your skin tone. With a large eyeshadow brush, swipe black eyeshadow over your whole eyelid. As you’re applying, make sure to move the brush back and forth (see the pink lines on the eye graphic). Take a medium sized brush, and rotate black shadow within the inner corner of your eye. Allow your hand to move freely, and it’s encouraged that your shadow not be limited to just your lid, but outside the crease as well. Using a tilted liner brush, swipe the shadow upwards and out at the outer corners of your eyes. Look in the mirror….wink, and go! *Images courtesy of latahvalley.org and justjared.com . Graphics courtesy of Chic Intuition Inc.",
