                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2010/01/lara-stone.jpg"],
                            "post_text_content": "January 12, 2010 | Tags: Celeb Chic We love seeing new models down the runway, especially when they have quite a unique aesthetic. Lara Stone, born to a Dutch mother and an English father, was actually ‘discovered’ at the ripe age of 12. She signed onto Elite Model Agency at the age of 15, but her career didn’t flourish until she switched to IMG in 2006. What we love about this girl is her chameleon affect. She can pull off any look, with full confidence and swagger. Fun fact? She’s known for her wobbly runway walk, attributed not to her own talent, but the fact that she has quite small feet for her height (a size 7 in a size 9-10 world). In the February 2009 edition of Vogue Paris, which featured Stone on the cover and sole model in the magazine, she said she does not like the runway; that her unusually small feet for a person her size do not fit in shoes, and she often thinks, “Do not fall, do not fall.” Take a closer look at this gap toothed beauty who proves that different is special. *Images courtesy of style.com . Graphics courtesy of Chic Intuition LLC.",
