                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/07/lautre-chose-boots.jpg"],
                            "post_text_content": "July 16, 2008 | Tags: Chic Find I think you pretty much get how I feel about these shoes . Combining two of my favorite things: fringe and booties and, as you see, the result is glorious! I can just see the endless outfit variations that go with these. Tucked into skinnies, accenting a poufy skirt, or paired with tights. Now, if only my 5’9″ frame wouldn’t let me down when it comes to balancing myself in heels…. I guess I can live my dream through Chic Critic (you better go buy em!) *Images courtesy of my-wardrobe.com . Graphics courtesy of Chic Intuition Inc.",
