                            "post_timestamp_unparsed": "January 13, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/01/office-attire.jpg"],
                            "post_text_content": "January 13, 2009 | Tags: Ask Chic Chic Reader Kacee writes: “I’m 20 years old [and] looking for a chic way of dressing up for an office job. I want to do something different but still want to be appropriate. After all, I am young and love fashion. Can you help me please? Thanks for your help. “ There are numerous ways to look office appropriate but stylish simultaneously. Right now I’m writing this while donning wool leggings, a long tunic sweater, leather jacket and fringed scarf (all black)…at the office. On the other hand, we’d still have to say that it depends on where you work and how lenient their dress code is. But even if the job requires you to wear a blazer on a daily basis, you can still manage to make it look chic. We’d recommend starting off with 6 basic wardrobe staples any fashionable working woman needs, and then altering looks with funky accessories. Who says you can’t wear yellow pumps to work, or a fab multi-chained necklace? We say don’t shy away from playing up otherwise boring looks by adding simple yet striking additions. And don’t forget, work it girl! (literally as well…) *Images courtesy of net-a-porter.com . Graphics courtesy of Chic Intuition Inc.",
