                            "post_url": "http://www.chicintuition.com/?p=4140",
                            "title": "Chic Interview: Fashion Chalet",
                            "post_timestamp_parsed": "2009/07/27",
                            "post_timestamp_unparsed": "July 27, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/07/fashionchalet.jpg"],
                            "post_text_content": "July 27, 2009 | Tags: Chic Interview We’ve been silently following our latest interviewee for some time now, and loved witnessing her online evolution. She exudes a bright, sunny presence taking after her hometown Miami, Florida. This 26 year old is a blogger, who we can safely say, has gotten chameleon style down pat. She can dress up like an elegant movie star, or dress down like a rocker girl. The unwavering factor in it all? Her love for fashion. Take a look at what she had to say to us, and then head on over to her lovely blog . Chic Intuition: We’ve been following your blog for a while now, and noticed the evolution of your style. What triggers your outfit choices? Erika: Thank you. Being a fan of your website, that means a lot!! I change depending on mood and whatever I am immersing myself with from all around. I pull from everything that inspires me in someway. Celebrities play a large role, of course, as do model’s style choices and preferences; but a lot of it also stems from music, movies and magazines that inspire me. Mood definitely plays a large role. Chic Intuition: We love seeing street style photos from different fashion capitals, there’s a certain vibe that can be associated with each city. Do you feel that living in Miami influences your style? Erika: To be honest, no. All I see are tank tops, jeans/shorts and flip flops. I call it “messy beach bum wear without any flair.” I like to pretend I live in another City or Country when I’m getting dressed to go out (be it to dinner or to the grocery store.) Chic Intuition: On your blog you state that you “breathe and dream in fashion.” Any future plans in the industry? Erika: I sure hope so!! Styling professionally is my ultimate dream, but I’d also love to dabble in writing, fashion coverage from all over the World, if possible. Chic Intuition: You were featured on the Urban Outfitters Catalog (yay!). Do spill details! How was the experience for you? Erika: Exciting, I was contacted to model a few pieces for the blog and then they would later choose which one to showcase on their website. I was notified of being online on Urban Outfitters’s homepage by many of my Facebook friends, shout outs to them!! Chic Intuition: So we can’t ignore the fact that you own a pair of the greatly coveted Sam Edelman booties ( reminiscent of the Olsens’ Balenciaga’s ). No one could predict their online popularity. Do you have any idea how many fashionistas would kill for a pair? Erika: It all started when I first saw them gracing the Olsens’ feet. Especially MK’s. When I saw how easily they pulled an outfit together my heart couldn’t stop beating for them. I enjoyed watching the many ways Mary-Kate incorporated them into just about any and every look (with mini dresses, skinny jeans and extra long t-shirts) were ( and still are ) my favorite. Then Rumi got them, only enticing me further. Now that I finally have them, I must admit the magic has yet to disappear, I just love them that much. ( thanks to Nicole for hooking me up! ) Chic Intuition: Talking about the Olsens, we think we’ve finally found someone who’s as obsessed with them as we are. What do you think their secret to style is? Erika: I think the truth is not overthinking it. They grab and they go. Always effortless yet pulled together, just enough. It also doesn’t hurt that they have access to every single label I dream and covet to run my fingers over…. Chic Intuition: And finally, philosophical question time: how stylish is too stylish? Erika: When you are wearing one designer head to toe and it’s either too matchy-matchy or costumey. Mix high & low, that’s the best; especially Vintage- my favorite. *Images courtesy of fashionchalet.blogspot.com . Graphics courtesy of Chic Intuition LLC.",
