                            "title": "Kim Kardashian Makeup Chic",
                            "post_timestamp_parsed": "2008/08/04",
                            "post_timestamp_unparsed": "August 4, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/08/kim-kardashian-makeupchic.jpg"],
                            "post_text_content": "August 4, 2008 | Tags: Celeb Chic Who better to pose for a zoomed in shot than Kim? Let alone the fact that she has, well, perfect features in our minds, her fresh-faced fall makeup is the best photo you can follow. We already hinted at what products you need to invest in this winter, but to get her look here: Moisturize the face and neck area with Clinique Dramatically Different Moisturizer . With a large brush, evenly apply Bare Escentuals i.d bareMinerals Powder Foundation all over. Focus on the cheeks and temples for extra highlights. Afterwards, smoothly dab Benefit Boi-ing Concealer under and around the inner corner of the eyes. With a soft brush, apply Sephora Light Touch Highlighter from the lashline all the way up to the brow bone of the eyes. Don’t over apply. With a small brush, line the upper and lower lashlines with Dior Impression Cuir Leather Couture eyeshadow. The key here is to be messy, and not focus on applying a straight, bold line. Finish off the eyes with generous coats of Givenchy Phenomenon Eyes Mascara . To achieve high volume without applying false eyelashes (as seen on Kim Kardashian), apply one coat of mascara, wait a bit, and apply the second. With a small brush, apply Cargo blu-ray Blush/Highlighter to the apples of the cheeks. Line your lips with Nars lipliner in Jungle Red . With a lipstick brush, apply Kat Von D Painted Love in Hellbent . Smile, and walk out the door! *Images courtesy of justjared.com and sephora.com . Graphics courtesy of Chic Intuition Inc.",
