                            "post_text_content": "October 14, 2010 | Tags: Uncategorized A few days ago GAP debuted a new logo. A few seconds later, the internet went bazirk with hate comments. I have to admit, I was one of the haters. Being an architect and dabbling in graphic design, I saw the new logo as weak, dated, and just too Graphics 101 for me. Nothing compared to the original GAP logo that we’re so used to. Happy to say that the retailer actually went back to their original logo. Our fave hate comment? “I think [the logo] could be slightly more boring if they really made the effort. They can’t even do boring right anymore”. So the blogosphere is king! Like they say, if it ain’t broke… *Graphics courtesy of Chic Intuition LLC.",
