                            "post_text_content": "August 7, 2009 | Tags: Chic Alert For a limited time only, Gap has opened a premium denim pop-up store on the famous Roberston Boulevard. This store will be selling the new Gap premium denim line 1969 slated for release in the Fall. “With this new collection, named in honor of Gap’s debut year, we completely reworked and redesigned the jeans at every level, from design and fit to fabric, fasteners and production,” said Gap’s EVP of Design, Patrick Robinson. “Our goal was to create a range of styles that were cool, sexy and relevant for right now. Every style tells a story and there’s a fit for everyone – we created great fitting jeans that really complement and accentuate different body types.” I will definitely be going up to LA to checkout this cool store and get me some jeans which start from $59.50 FYI! If you’re interested in going as well, the shop will be open from Friday, August 7, 2009 – Sunday, September 27, 2009 (Monday – Sunday: 10:30 a.m. – 7:00 p.m) at 108 N Robertson Blvd, Los Angeles, CA 90048.",
