                            "post_timestamp_parsed": "2009/07/15",
                            "post_timestamp_unparsed": "July 15, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/07/celeb-style-for-less-copy.jpg"],
                            "post_text_content": "July 15, 2009 | Tags: Celeb Chic While it seemed that the only way to get celeb style in the past was through maxing out our credit cards buying luxury items that we couldn’t afford, it’s now possible to attain the exact celeb look without the hefty price tag. 2005-2008 was all about excess (remember Nicole Richie’s collection of Balenciaga handbags in every color?). 2009, however, is all about recessionista chic. Hot pieces, great prices, and being able to pay your credit card bill at the end of each month is the new thing! This trend is so hot that even fashionistas such as Jessica Szohr, Kim Kardashian, and Olivia Palermo have hopped on the budget-friendly wagon. True, they pair their inexpensive pieces with a Temperly London jackets, Zanotti shoes, and an Hermes Birkin but it’s nice to see that at least part of their look is under $100… *Images courtesy of style.com and imnotobsessed.com . Graphics courtesy of Chic Intuition LLC.",
