                            "post_text_content": "December 27, 2012 | Tags: Celeb Chic She can rock a plum colored coat like no other… *Image courtesy of lefashionimage.blogspot.com . Graphics courtesy of Chic Intuition LLC.",
                            "comments": [{
                                "Text": "A helpful correction from a copyeditor: Pluming is a word meaning to decorate with feathers (from the root of the word plume) or to indulge in one’s vanity by a show of prideful achievement. I doubt you meant to use this word to describe Victoria Beckham as she is not wearing feathers in the photo and it seems a non sequitur to accuse her of frivolous pomp.",
                                "Timestamp_parsed": "2012/12/28",
                                "Timestamp_unparsed": "Kirsten on\n\t\t\t\t\t\tDecember 28th, 2012 4:03 am \n\t\t\t\n\t\t\tA helpful correction from a copyeditor:  Pluming is a word meaning to decorate with feathers (from the root of the word plume) or to indulge in one’s vanity by a show of prideful achievement.  I doubt you meant to use this word to describe Victoria Beckham as she is not wearing feathers in the photo and it seems a non sequitur to accuse her of frivolous pomp.\nFollowing your caption, I’d recommend you edit the headline to read:  “Plum-ing.”\nCheers!\nK"
                            }]
