                            "post_timestamp_unparsed": "January 26, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/01/vanilla-scented-interview.jpg"],
                            "post_text_content": "January 26, 2009 | Tags: Chic Interview The moment we first spotted this 19 year old from Norway, we new we had to add her to our ever evolving Bookmarks Tab (under the Folder appropriately entitled Hot Bloggers! ). Maria manages to make daily outfit posts events on their own, with amazing thrift purchases that melt our hearts. The fact that she’s so laid back is even more assurance that it’s not hard to look good. It just takes a little style, and some lovely scents… Chic Intuition: So what is vanilla scented? Your cologne? Room? Car? Maria: Yeah my car. Hehehe. I was trying to come up with a name for the blog, and my actual Vietnamese name is “Van”, so I searched for it on the web and up came vanilla. Thought it was cute but I wanted something more and so I added “scented”. As exciting as that. Chic Intuition: We’re not going to ask the boring question of why you started a blog, but rather, what keeps you posting? Maria: Why dress up if no one can see you? I want to share my interest in fashion and trends with others. Also all of the positive feedback I get from people encourages me to keep posting. Chic Intuition: What would you say are 3 main inspirations to your daily outfits? Maria: I want to look cool, laidback and trendy. Other than that I’m very inspired by other bloggers, the catwalk, street style and celebs. Chic Intuition: Scenario, you’ve only got 10 minutes to pack for a quickie tropical getaway. What items do you stash in your suitcase? Maria: Doesn’t matter! We’re talking about a tropical getaway here! Haha. I’d need a sheer white tanktop, light washed ripped jeans shorts, a cool cut-out bathing suit and I’m good to go! Chic Intuition: Vintage vs New. What do you prefer and why? Maria: That’s a hard one! No way I could chose.. Vintage, because the items are unique and the quality and shapes is hard to find nowadays. New, because trends and fashion keeps evolving and I gotta catch up! Chic Intuition: We literally stored the images of your DIY studded leather jacket. How many compliments (aka girls trying to grab it off you) have you gotten so far? Maria: 573. Hehe no. But many! I see why – it is killah I couldn’t be more satisfied with it! Chic Intuition: And finally, philosophical question time: how ruffled is too ruffled? Maria: When people start talking about wedding cakes wherever you go. *Images courtesy of vanillascented.com . Graphics courtesy of Chic Intuition Inc.",
