                            "post_text_content": "January 31, 2009 | Tags: Celeb Chic They’re baaaaaaack ! Wow we first spotted them chit chatting a while back, and now there’s even more proof that Nicole Richie and Rachel Zoe are on good terms. Now, let’s focus on what’s even more important: their fashions. We are in love with Nic’s summer kaftan. The colors and loose fit are just what you need for an easy outfit solution. We’ve found an eerily similar cut by Issa which you can purchase here . Happy shopping! edit: We found out that her actual dress is by Issa as well! Ooh we’re good ! *Images courtesy of popsugar.com and shopbop.com . Graphics courtesy of Chic Intuition Inc.",
