                "crawl_timestamp": "2018-02-01 08:10:34 +0000",
                "domain_name": "<chicintuition><Chic_Under_></Chic_Under_>$...>\n            <post_url>http://www.chicintuition.com/?p=3341</post_url><title>Boyfriend Jeans Under $50</title><post_timestamp_parsed>2009/02/09</post_timestamp_parsed><post_timestamp_unparsed>February 9, 2009 </post_timestamp_unparsed><image_urlstype=\"array\" type=\"array\"><image_url>http://www.chicintuition.com/wp-content/uploads/2009/02/bf-jeans-under-50.JPG</image_url></image_urls><post_text_content>February 9, 2009 | Tags: Chic Under $... So it seems like lately with this tired economy it’s all about saving and making smart purchases. That’s why when on the search of the perfect Boyfriend Jeans for myself, I wanted to make sure not to spend too much. Why you may ask? Because I consider the BF jean to be a trendy and not a staple piece for my wardrobe- one that I expect will disappear by the fall. I may be wrong, though, since I was wrong about the skinny jean but I’m willing to try it out and maybe invest in a more expensive pair if I see a future for them. Sounds like I’m getting married or something huh? Lol! Anyways, I went on the lookout and found four amazing pairs for under $50! Check ’em out and help me choose which one to get. Indigo Saints Shredded Boyfriend Jean $49.50 Frayed Denim Capri $22.80 BDG Boyfriend Patchwork Jean $29.99 Charlie Low-Rise Boyfriend Jean $49.50</post_text_content><commentstype=\"array\" type=\"array\"><comment><Text>I’m not sure I’ll ever get use to this trend – it reminds me too much of the elastic tapered jeans you see in the Sears catalogue.</Text><Timestamp_parsed>2009/02/10</Timestamp_parsed><Timestamp_unparsed>Kira on\n\t\t\t\t\t\tFebruary 10th, 2009 6:40 am \n\t\t\t\n\t\t\tI’m not sure I’ll ever get use to this trend – it reminds me too much of the elastic tapered jeans you see in the Sears catalogue.</Timestamp_unparsed></comment><comment><Text>I do not like one or three. I would probably go for two (because four is too symmetrical or something with the holes on the same place on each knee).</Text><Timestamp_parsed>2009/02/10</Timestamp_parsed><Timestamp_unparsed>Julie on\n\t\t\t\t\t\tFebruary 10th, 2009 5:54 pm \n\t\t\t\n\t\t\tI do not like one or three. I would probably go for two (because four is too symmetrical or something with the holes on the same place on each knee).</Timestamp_unparsed></comment><comment><Text>I actually purchased 2 in a darker shade and went a size smaller so it wasn’t TOO baggy. And I love them!</Text><Timestamp_parsed>2009/02/11</Timestamp_parsed><Timestamp_unparsed>christine on\n\t\t\t\t\t\tFebruary 11th, 2009 3:47 am \n\t\t\t\n\t\t\tI actually purchased 2 in a darker shade and went a size smaller so it wasn’t TOO baggy. And I love them!</Timestamp_unparsed></comment></comments></chicintuition>$...>"
