                            "post_text_content": "October 31, 2008 | Tags: Celeb Chic While many blogs have emphasized on recreating Kate’s outfit from last night’s Blackberry event, we Chics were more in awe of her gorgeous makeup. It’s been awhile since we’ve helped you achieve a celeb’s fresh-faced look and Kate’s is the perfect face with which to make a comeback! To get her look: Face: Rub You Rebel in Lite all over face and neck. Eyes: Brush Bare Essentials bareMinerals Glimmer in Sunshine onto eyelids from lashline to browbone. Next, line eyes with Clinique Quickliner in Black/Brown . Lastly, use the Lancome ÔSCILLATION – Vibrating Infinite Powermascara on top and bottom eyelashes. Cheeks : Apply a few drops of Benefit Posie Tint onto cheekbones. Rub it in using tips of fingertips. Repeat until desired flush is achieved. Lips: Slick Dior Addict Ultra Gloss Reflect in Organza Pink onto lips and VOILA you’re ready for a night on the town! *Images courtesy of justjared.com and their respective links. Graphics courtesy of Chic Intuition Inc.",
