                            "post_text_content": "August 6, 2009 | Tags: Ask Chic Chic Reader Kimberly writes: “ Hi there! I love Chic Intuition and I always know that you can help a fellow fashionista in need I came across these photos of Hayden Panettiere and instantly fell in love with her feather sequin top by Topshop. However, it is now sold out on their UK site. I love the elegance of the sequins and beading with the mint green color and feather shaped detail. Can you please help me find a very similar top with the same elegance?! In the mean time I plan to wait it out on ebay for the same one or a restock on Topshop Thank you! “ Hi Kimberly! Thanks for the love. Well, we looked all around for a similar top and we were completely unsuccesful until we were working on another story looking for dresses and stumbled on a very similar piece! Yay! It’s the MLH Selena Floral Sequin Dress and I personally think it will look amazing belted over a pair of super skinny jeans and some heels. Hope this helps!",
