                            "post_text_content": "August 8, 2008 | Tags: Celeb Chic , Chic Review Seems like everyone is jumping on the “handbag designer” wagon. We support any great designer like the next chick, but we honestly won’t buy an item just because a celebrity designed it. Camila unveiled her boho inspired handbag collection entitled Muxo (“Goddess of the water” in an African legend) at Kitson, LA. At least she’s doing some good with her profits, the collection is associated with Stand Up To Cancer and will soon be releasing a SU2C handbag. What do you think of the extra extra fringed up handbag Camila is sporting? *Image courtesy of justjared.com . Graphics courtesy of Chic Intuition Inc.",
