                            "post_text_content": "October 12, 2009 | Tags: Chic Review I can’t believe the season is ending! I mean, feels like we just started getting our daily lives in check around Monday nights. For example: “Hey Chic Freak, wanna grab dinner tonight?”, pause and think what tonight is, “Oh hun, I can’t. I have a….dentist appointment”. Why lie? No friend wants to hear that they’re ditched for a TV show. So I guess the lying might stop now… Want to hear what’s in store for the last episode? After her recent struggle with Vertigo, Rachel gets strict doctors orders that she needs to slow down or she will wear herself out. The solution? Rachel calls a team meeting to announce that Rodger will be taking over the business side of Rachel Zoe Incorporated. But how will this affect Taylor’s role on the team? With her frustration with her job at a breaking point, Taylor finally confronts Rachel with her issues and her future on Team Zoe – will Rachel honor her requests or will Taylor quit?",
