                            "title": "Rachel Bilson Makeup Chic",
                            "post_timestamp_parsed": "2008/09/06",
                            "post_timestamp_unparsed": "September 6, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/09/rachel-bilson-makeup.jpg"],
                            "post_text_content": "September 6, 2008 | Tags: Celeb Chic , Chic Tips Ummm… wow ! Talk about Rachel working it! Her perfected matte face and shimmery bronze eyes are coupled with a shy nude lip, and we know you all want to copy her! To get the look: With a wet sponge, apply YSL Matt Touch Foundation SPF 10 onto your face and neck. An important secret is to always apply foundation in upward motions; helps ward away future facial sagging! Then slowly rotate blush brush onto apples of the cheeks with Sephora Smashbox Blush. I love applying blush to my face as a first after foundation, this helps your face pop. With your fingertips, apply the lightest shade (Bouquet) on the Stila Eyeshadow Pan pallete all over your eyelids and browbone. Then smother your lids with the medium shade (Jezebel). Finally finish off inner and outer eye corners with the darkest brown shade (Espresso). Smudge Clinique Quickliner in Dark Chocolate on upper and lower lashes. It’s ok to be messy, that’s our fave part about the smoky eye! Look up, and generously apply Givenchy Phenom Eyes mascara to upper lashes. Finally, look in the mirror; SMILE and apply Vincent Longo Wet Pearl lipstick in Dahlila Fresh! Viola! *Images courtesy of justjared.com and sephora.com . Graphics courtesy of Chic Intuition Inc.",
