                                "Timestamp_unparsed": "Jade Cullen on\n\t\t\t\t\t\tJuly 6th, 2010 11:19 am \n\t\t\t\n\t\t\tI completely agree to that too many piercings look tacky, i have my lobes and tragus pierced and am planning on getting my second lobes and one upper cartilage then im done…"
