                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/11/nail-art.jpg"],
                            "post_text_content": "November 19, 2008 | Tags: Celeb Chic , Not Chic We weren’t really sure how to categorize this post, as you can tell by the contradicting choices above, and we guess that further proves the point of this post. What’s your take on nail art? Celebs seem to always find different, and sometimes cheesy, ways of adorning their nails, even sometimes stating their political views with a few swipes of polish (we’re talking to you Eve). How necessary, and mature, is nail art? Is there a specific forum where it’s appropriate to have little butterflies, stripes, and swooshes on your nails, or can you get away with pretty patterns in a business meeting with your boss? Personally, I think to each her own, and if you’re a performer, have some fun with it. But if you have any links with the corporate world, then stay away (or at least wait till the weekend)… *Images courtesy of people.com , killahbeez.com , and haiba.cn . Graphics courtesy of Chic Intuition Inc.",
