                            "post_text_content": "July 7, 2008 | Tags: Celeb Chic , Chic Alert You know you’ve spotted a Hollywood trend when you’ve seen it more than three times in one week. The newest accessory of choice? Hippie headbands! With bohemian chic as the current obsession of the moment, it only seems natural to top it off with this quirky accessory. Fret not girls, we’ve found a way to get you an amazing one of your own! Check out this gorgeous Peacock Headband from Madison LA. If that one is a little too pricey for you, try this equally hot Daisy Strand Stretch Band from Free People. Now find your most flowy maxi dress or tunic top and pair it with this piece to become the talk of the town… Any press is good press right? *Images courtesy of justjared.com and imnotobsessed.com . Graphics courtesy of Chic Intuition Inc.",
