                            "post_text_content": "November 20, 2008 | Tags: Chic Alert The first pieces of information about the collab between McQ and Tarjaay have been release by WWD. Here’s what the designer had to say of his inspiration for the line: “We use icons in British music, and [Liela Moss] stood out. She’s a great-looking girl and has a personal style. It fell into the idea of the New York underground music scene. It was more the atmosphere she portrays.” And more on the line itself: “The collection has a muted color palette of black, white, gray and tan with accents of cobalt blue and bright pink. Studs and mesh give items an edge. There are studded jeans, shorts and denim jackets with asymmetrical closures, short tuxedo jackets and matching shorts, dresses in a blue and white painterly fabric, a one-shoulder dress in a gray-and-black zigzag pattern with a thick black belt, and a T-shirt with the image of Moss. The designer’s favorite pieces in the line include “the pink and black pieces and the little prom dresses.” The images below are (left) of Leila in in a cotton mesh dress and rayon tank from McQ Alexander McQueen for Target, and the image on the right features a Silk-screen cotton jersey T-shirt over cotton and spandex denim pants by McQ Alexander McQueen for Target. Personally, we’re not feeling it yet. Pretty plain jane if you ask us, but we’ll give it the benefit of the doubt and wait for more images before we reach a final decision. *Images courtesy of wwd.com . Graphics courtesy of Chic Intuition Inc.",
