                            "post_url": "http://www.chicintuition.com/?p=8936",
                            "title": "Chic Interview: stylestalker",
                            "post_timestamp_parsed": "2010/07/01",
                            "post_timestamp_unparsed": "July 1, 2010 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2010/07/stylestalker.jpg"],
                            "post_text_content": "July 1, 2010 | Tags: Chic Interview Seems like we’re on a high for anything Aussie these days, so we decided to interview one half of Australian fashion label stylestalker . It’s fresh, stylish, and most importantly-reasonably priced. The force behind the line? Two young friends, Rachel and Sue-Ann, self-confessed style addicts. “We were drawn together by our mutual addiction to ‘stylestalking’; scouring magazines, trawling the web and traveling to all parts of the world to devour all things style. We decided to create a label to satisfy our fashion cravings.” Take a look at what Sue-Ann had to say below: Chic Intuition: Our love for Aussie designers is growing by the day. The amount of talent there is overwhelming. What got you into clothing design? Sue-Ann: My best friend Rachel and I were obsessed with clothes but couldn’t find anything we wanted to wear which was within our price point. So we decided to create our own. I think that’s why there is so much great designs coming out of Australia, cause you just need a great idea and anything is possible. Chic Intuition: Coming up with ‘new’ creations in fashion can sometime be quite an aggravating experience. Where do you two find inspiration when you reach a dry spell in design? Sue-Ann: We find blogs really inspiring. The way that girls put stuff together and add their own little touches the world of fashion blogs is pretty amazing our faves are zanita.com.au, fashiontoast.com, 4thandbleeker.com Chic Intuition: Please tell us about your latest collection. Sue-Ann: Our latest collection (will be on the website in July) is called “wipeout” and it is inspired by the fun surf beach culture of Australia. Lots of easy shapes, interesting dye’s and killer LBD’s Chic Intuition: Anything in store for the future of Style Stalker? Where do you see yourselves ten years from now? Sue-Ann: Not too sure, hopefully a shop somewhere fabulous… *Images courtesy of stylestalker.com . Graphics courtesy of Chic Intuition LLC.",
