                            "post_text_content": "August 19, 2009 | Tags: Chic Alert We’re excited to let you know that Rachel Roy’s new affordable collection for Macy’s Rachel | Rachel Roy is now available at select Macy’s stores across the U.S.! The Rachel | Rachel Roy collection includes affordable contemporary sportswear, footwear and accessories. The collection will be offered exclusively through Macy’s Inc. at select Macy’s stores nationwide and on macys.com . The entire collection will also be available for purchase on RachelRoy.com starting on August 26, 2009. The Rachel | Rachel Roy collection captures a fresh and youthful look that reflects today’s culture by mixing elements of downtown cool with uptown chic at affordable price points. The line will retail from $59 to $299 for sportswear, $79 to $199 for footwear, $40 – $195 for jewelry and $69 to $109 for handbags. We showed you a glimpse of the items that are available online , and we’ll make sure to remind you again come August 26th! Can’t wait for those hot accessories! *Images courtesy of www.flickr.com/photos/rachelroy . Graphics courtesy of Chic Intuition LLC.",
