                            "post_text_content": "August 10, 2009 | Tags: Not Chic Amanda Bynes: We know Herve Leger really works for you but you’ve made that point oh so clear! Sometimes not stepping out of your comfort zone can be a fashion no no. Alexis Bledel: A girl with her heart in two places. Her dress says fancy yet her shoes say edgy. Next time try listening to only one of the fashion voices in your head. Miley Cyrus: Ummm… can I get a SKANKY??? Nikki Reed: Lesson number one, the cut of a dress has to be edgy enough to carry the print. Lesson number two, a hot clutch and great shoes can never save a mess of a dress. *Images courtesy of prphotos.com . Graphics courtesy of Chic Intuition LLC.",
