                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/05/hot-chocolate-and-mint.jpg", "http://www.chicintuition.com/wp-content/uploads/2009/05/love_struck_by_poop_art.jpg"],
                            "post_text_content": "June 1, 2009 | Tags: Chic Interview At first glance, one might think that our latest interviewee must be an artist of some sort. On the contrary, 24 year old Diana is a marketing consultant with a flare for everything, well, fun! Don’t get us wrong, she oh so amazingly dabbles in graphic design (check out her work below), but imagine how exciting it would be to go to work with such a colorful colleague. Loves it. Take a look at what this fab Jakarta native has to say and then head on over to her blog . Chic Intuition: Diana, we think that if anyone should have an outfit post blog, it should be you. We love how you manage to surprise us almost daily with your unique outfit combos. How much work does it take? Diana: Everyday is a new day to explore on fashion. I don’t think it requires that much of effort and even cash, just our willingness to pause for a moment and try to figure out different ways on wearing the same clothes. Chic Intuition: Seems like you don’t really follow the major trends, rather opting to create trends of your own. Why so? Diana: Trend for me is just a fresh breeze of what’s new at the moment, not a rule that dictates us what is to wear and whatnot. It’s hard for me to determine what’s actually in or out or accept said guides from so-called fashionistas, because I basically enjoy fashion as art and art is very personal. Chic Intuition: Sometimes we find similarities between your style and Harajuku Japanese street style. Quirky colored leggings, mismatched top and pants, and over-sized accessories. We love! Who/what inspires you? Diana: Japanese street style serves as a very good example of how dressing up can be (and should be!) so fun, and I admire them for that! I am inspired by the Harajuku Japanese, in the sense that I try to have as high of confidence as they have. I’m such a random person, and I often have so much random ideas..randomness is my inspiration 😀 Chic Intuition: In Indonesia, are people as accepting of your unique taste? Diana: Sometimes they are, sometimes they’re not. I do often get confused stares, but you could always stare them back, right? ;p Chic Intuition: We’ve noticed that you’ve recently started dabbling in styling. Any future plans in such an occupation (even though you work in marketing–please correct us if we’re wrong). Diana: I’d love to have a clothing line one day, but without the sacrifice of my main job in the corporate world. I love juggling between those two different worlds Chic Intuition: Finally philosophical question time, how colorful is too colorful? Diana: When too much fun brings you no good *Images courtesy of dianarikasari.blogspot.com and poop-art.deviantart.com . Graphics courtesy of Chic Intuition LLC.",
