                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/10/vanessa-hudgens-dress.jpg"],
                            "post_text_content": "October 29, 2008 | Tags: Ask Chic Chic reader Emma writes: “Hi! I go to your site religiously and I know you guys are magicians when coming to find items that people want, so I figured I’d give it a whirl. I am in love, IN LOVE with the dress Vanessa Hudgens wore to one of the HSM3 events, it was bananas. A white Calvin Klein mini with long sleeves. I was wondering if you guys can find something similar and for cheaper? Thanks so much!” We think you’ve come to the right place Emma, ’cause if you want it, but can’t afford it, we love looking for alternatives. Funnest task ever! We scoured the web and chose our top 3 picks for Vanessa’s look for less. Happy shopping! Kate and Kass Alice Paul 3/4 Sleeve Mini Dress in Ivory $44 Velvet Verona Swiss Dot 3/4 Sleeve Dress in White $121 MaxStudio Cotton Cashmere Sweater Dress $55 *Images courtesy of justjared.com and their respective links. Graphics courtesy of Chic Intuition Inc.",
