                            "post_text_content": "August 31, 2009 | Tags: Celeb Chic Since the second episode of The Rachel Zoe Project is airing tonight, we only felt it necessary to address the following chic topic. A number of you have been avidly inquiring about Taylor Jacobson’s watch that she has been wearing episode after episode. We scoured all the images we could find, and it’s clear that she is wearing a personal fave: a Rolex Day-Date. Her specific model is actually vintage, since the Day-Date has gone under a mini makeover. We assume that Taylor’s watch is the 1974 President Day-Date in 18k Yellow Gold . You can find the actual watch on bid websites like eBay, just beware knock-offs. Now, we know that Taylor Jacobson is a famous stylist who works for the glorious Rachel Zoe and probably has a paycheck that anyone dreams of. So for you frugal fashionistas out there, we scoured the web for some much less pricey options. Happy Shopping! Freelook Oversized Watch $300 Michael Kors Watches Jet Set Sport Watch $250 Nixon The Time Teller Watch $90 *Images courtesy of justjared.com and their respective links. Graphics courtesy of Chic Intuition LLC.",
