            "pageurl": "http://www.chicintuition.com/?p=2985",
            "record": {
                "uniq_id": "fc087524d515c0e71a321323bfdaa1b9",
                "crawl_timestamp": "2018-02-01 08:11:50 +0000",
                "domain_name": {
                    "chicintuition": {
                        "Real_Life_Chic": {
                            "post_url": "http://www.chicintuition.com/?p=2985",
                            "title": "Getting Your Bang On",
                            "post_timestamp_parsed": "2008/12/18",
                            "post_timestamp_unparsed": "December 18, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/12/celebrity-bangs.jpg"],
                            "post_text_content": "December 18, 2008 | Tags: Real Life Chic I was invited to the opening of a friend’s art exhibit, and wanted to look hot (who doesn’t right?). Since I’m growing out my bob, I decided to make a change and just bang it. I was so excited, I even contemplating taking the deed into my own hands. I mean, how hard can it be to cut off a measly few hairs in a horizontal line right? Wrong. I was on the brink of receiving a visit from my monthly friend, Miss P, and felt like I could do anything . Ladies, take my advice and don’t make any rash decisions when you are PMSing. Hormones somtimes act like your best friend, or your worst enemy. I starting googling ‘ celebrity bangs ‘ and even created a whole folder dedicated to my fave finds. I didn’t even know which image to choose, I just thought whatev, my hairdresser can pick whatever one she likes (or can pull off). That’s when I accidentally found this hilarious article (which I now can’t find for the love of God) that stated that if you’re on your period, just off a breakup, or going through any sudden psychological manifestation, you should steer clear of wanting bangs . It also stated that there’s much more drama involved with the upkeep of bangs than us bangless beauties can imagine (Scenario A: waking up with a cowlick on top of your forehead). I slowly started to think twice about my decision, and by the next morning I was so happy about not taking the plunge. So remember ladies, only make life altering decisions (aka cutting your bangs) when you are emotionally sober. But seriously do you still think I should get them? *Images courtesy of beauty.about.com, women-hairstyles.com, and coutureinthecity.com. Graphics courtesy of Chic Intuition Inc.",
                            "comments": [{
                                "Text": "Hilarious! In a fit of work frustration, I was going to get bangs last night!!! Am definitely pmsing. But may definitely still get them 😉",
                                "Timestamp_parsed": "2008/12/18",
                                "Timestamp_unparsed": "Diabolina on\n\t\t\t\t\t\tDecember 18th, 2008 11:56 am \n\t\t\t\n\t\t\tHilarious!  In a fit of work frustration, I was going to get bangs last night!!!  Am definitely pmsing.  But may definitely still get them 😉"
                            }, {
                                "Text": "Bangs are really not that hard to maintain, in my opinion. They’re easy to fix in the morning if mussed it up in your sleep. I used to just wet it and blow dry. I say “used to” because I’ve had bangs for as long as I can remember, but I’m in the process of growing them out right now.",
                                "Timestamp_parsed": "2008/12/18",
                                "Timestamp_unparsed": "spiraljetty on\n\t\t\t\t\t\tDecember 18th, 2008 3:37 pm \n\t\t\t\n\t\t\tBangs are really not that hard to maintain, in my opinion.  They’re easy to fix in the morning if mussed it up in your sleep.  I used to just wet it and blow dry.  I say “used to” because I’ve had bangs for as long as I can remember, but I’m in the process of growing them out right now.\nIf it sounds scary, I would say get a soft wispy fringe that transitions to layers to the side of your face.  It’s easier to clip back on days you don’t want them and will look natural if you decide to grow them out again.  If you feel bold, you can take the extra step and get the super blunt style!\nOh, and a few other things…don’t ever try cutting or trimming your own bangs unless you’re a hairdresser with professional shears.  It’s nearly impossible to get the clean lines and shaping with everyday shears and it WILL look obvious that you cut them yourself.  If your hair gets greasy, it will show more since you have hair that falls forward.  And I read you should avoid bangs if you have a very small face/forehead, because it will make all features seem to crowd to the center of the face.\nSorry for the long post, but I’ve had a love/hate relationship with my bangs most of my life!  Good luck."
                            }, {
                                "Text": "If it sounds scary, I would say get a soft wispy fringe that transitions to layers to the side of your face. It’s easier to clip back on days you don’t want them and will look natural if you decide to grow them out again. If you feel bold, you can take the extra step and get the super blunt style!",
                                "Timestamp_parsed": "2008/12/18",
                                "Timestamp_unparsed": "Sharon on\n\t\t\t\t\t\tDecember 18th, 2008 4:33 pm \n\t\t\t\n\t\t\tI think this article says it all:\nhttp://stuffwhitepeoplelike.com/2008/06/27/104-girls-with-bangs/"
                            }, {
                                "Text": "Oh, and a few other things…don’t ever try cutting or trimming your own bangs unless you’re a hairdresser with professional shears. It’s nearly impossible to get the clean lines and shaping with everyday shears and it WILL look obvious that you cut them yourself. If your hair gets greasy, it will show more since you have hair that falls forward. And I read you should avoid bangs if you have a very small face/forehead, because it will make all features seem to crowd to the center of the face.",
                                "Timestamp_parsed": "2008/12/18",
                                "Timestamp_unparsed": "Chic Freak on\n\t\t\t\t\t\tDecember 18th, 2008 5:01 pm \n\t\t\t\n\t\t\tWow thanks guys.  Ya spiraljetty, you’re so right about the small forehead comment.  I have the tiniest forehead, so I’m sure I’d look really weird with bangs…haha"
                            }, {
                                "Text": "Sorry for the long post, but I’ve had a love/hate relationship with my bangs most of my life! Good luck.",
                                "Timestamp_parsed": "2008/12/18",
                                "Timestamp_unparsed": "Nuri on\n\t\t\t\t\t\tDecember 18th, 2008 8:15 pm \n\t\t\t\n\t\t\tlol I’ll take that into consideration!\nBack in september i had a makeover and i got my hair short with bangs; and it looked great because i have a round face and the bangs my stylist did soften my features and gave it a more oval effect; and i fell in love with bangs again. But yeah; once in a while i wake up with a cowlick but i just brush my hair and it’s back to hotness.\nLast month I was kinda anxious and didnt have anything else to do and my bangs were huge and i couldnt really see so I though I should trim them myself. BIG MISTAKE! now they have a weird shape and they are not even straight or with some funky asymetric shape, they are hideous and my stylist didnt think of something to fix it because they were short so I am waiting them to grow now.\nI think bangs are great and can give you a more romantic or modern look depending on the type you go for and can help a lot on your face, but you really should check with your stylist and ask him/her if they would look good and which one works great for your face."
                            }, {
                                "Text": "I think this article says it all: http://stuffwhitepeoplelike.com/2008/06/27/104-girls-with-bangs/",
                                "Timestamp_parsed": "2008/12/19",
                                "Timestamp_unparsed": "Alice on\n\t\t\t\t\t\tDecember 19th, 2008 12:56 am \n\t\t\t\n\t\t\tIf you don’t want Liv’s bangs, go for a more side swept look.    I have side bangs and without them I would look horrible (I have a large forehead) and they’re not hard to maintain at all! My advice is just don’t get it cut too short so you’ll have a faster time growing it out if you don’t like it."
                            }]
                        }
                    }
                }
            }
