                            "post_text_content": "January 28, 2009 | Tags: Ask Chic Chic Reader Annie writes: “ I love Vanessa Hudgen’s style and when I saw her wearing these sandals I thought they were sooo adorable, but I don’t know where they’re from! Please help me find the exact pair, or possibly something similar to it! Thank you so much! “ Well Annie, it looks like you are in luck. At first we thought these babies must be either Moschino or Juicy, and yet they turned out to be by Chinese Laundry. Miss Hudgen’s loves a bargain and always dresses her age by opting for contemporary brands instead of stuffy premiere designers. These babies are the Sudoku Sandals and retail for about $69. A little bird also told me that you might be able to get a promo code for the site. Let me know how it goes so I can get myself a pair as well! Oh you Chic Readers and your fashionable eyes! *Images courtesy of justjared.com . Graphics courtesy of Chic Intuition Inc.",
