                            "title": "Leather Lessons",
                            "post_timestamp_parsed": "2010/02/09",
                            "post_timestamp_unparsed": "February 9, 2010 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2010/02/olivia-palermo-yes-and-no2.JPG"],
                            "post_text_content": "February 9, 2010 | Tags: Celeb Chic , Not Chic It’s hard to believe that someone who can make leather look so good can also make it look that bad! Don’t believe us? Check out exhibit A where Miss Olivia Palermo pairs a pair of leather leggings with a gorgeous military topper and an unexpected shoe pairing of grey booties. Now, head left towards exhibit B where she pairs some green leather shorts with a plaid top and black opaque tights and pumps. The result is absolutely shocking and definitely not in a good way. In any sense, one should proceed with caution when attempting the leather short by pairing it with a very feminine blouse in a complimenting color. A plaid shirt, however, takes the outfit to the country look you are trying to avoid in the first place! Not only that, but the fact that they’re bright green???? Come on! Well since you always look so good Olivia, we’ll give you a pass. Everyone is allowed a fashion flub once or twice in their lives right? *Images courtesy of thefashionspot.com . Graphics courtesy of Chic Intuition LLC.",
