                            "post_text_content": "September 23, 2009 | Tags: Ask Chic Chic Reader Liza writes: “Hi, Chic Intuition. I would like to know what hairstyles are in style for the Fall and what hair colors are in as well.” For Fall it’s all about easy versatility. The most popular trends we spotted on the runways? Either pixie short or totally boho long. Hair was always tousled, so it seems like the ‘out of bed’ look is back. If you don’t want to take the plunge with a shorter do, and you still haven’t reached length-worthy locks, then try the high bun for some easy fun (especially if you’re donning a scarf). As for color, we recommend toning it down to some darker roots appropriate for the cooler weather. Good luck ladies! *Images courtesy of style.com . Graphics courtesy of Chic Intuition LLC.",
