                            "post_text_content": "May 28, 2009 | Tags: Celeb Chic , Chic Obsessions I’d never heard of Jennifer Zeuner until I spotted the hottest silver hamsa bracelet online. I had just gotten myself a gold one from a trip to Lebanon, and my younger sister spotted it and wanted one (suddenly a wave of guilt went over me, why didn’t I buy her one as well?!). So I was determined to go on an online witch hunt and track a similar one down. I was pleasantly suprised when I spotted the Jennifer Zeuner Mini Hamsa Diamond Bracelet , and for the fraction of the price I had bought mine! So I obviously took the plunge and ordered one for sis. Little did I know that some of our fashion mentors (Whitney Port, Vanessa hudgens, Lauren Conrad, and Rachel Zoe) were huge fans of the label! Kudos to my ‘Chic Intuition’ *wink wink* You can get some of the love here . *Image courtesy of singer22.com .",
