                            "post_text_content": "February 12, 2009 | Tags: Not Chic What can you expect from the ‘most fashionable’ female out there? A lot when she’s designing a fashion line for hip label Topshop . We’ve been reviewing it every season, and weren’t really wowed by anything. But we always gave her the benefit of the doubt, and selected a few of our faves. On the other hand, this season is like no other. Why may you ask? Well, Ms Moss has chosen to take her inspiration from… a nursing home! ( We kid, we kid ). But honestly, after taking a look at the awful line, the only thing that comes to our minds is that grandmas everywhere will stand tall and proud, and might even purchase a few pieces if they’d fit. Representing the elderly in your fashions is a yes, but trying to sell them to 20 year old fashionistas is a MAJOR NO ! Blech… *Images courtesy of topshop.com and thesimpsons.com. Graphics courtesy of Chic Intuition Inc.",
