                            "post_text_content": "February 16, 2011 | Tags: Chic Tips I was recently invited to a Western themed shower and was adamant on finding something suitable right in my closet so I wouldn’t have to buy some ridiculous get-up that I’d only get to wear once. While browsing my ‘archives’ as I like to call them (think early 2000s) I stumbled on a pair of studded light wash bell bottom jeans. I must say that I was absolutely thrilled that they fit me considering that I was about 18 when I bought them. The fact that I just had a baby may have turned the volume of happiness up a notch. With that feeling of overwhelming pride, I had a strong desire to wear them out of the house and am happy to say that I finally can. Flares are back baby and are expected to be the hit silhouette for the summer. I actually feel confident enough to deem them the ‘new skinnies’. Get your Current/Elliott The High Rise Bell Jeans asap ladies! *Images courtesy of style.com . Graphics courtesy of Chic Intuition LLC.",
