                            "post_text_content": "April 9, 2010 | Tags: Chic Tips The Spring 2010 makeup trend spotted allover the Michael Kors runway was definitely the pastel smokey eye. Personally I’ve been doing the pastel smokey eye for years and especially love it for those hot summer nights and paired with a tan. Easy to achieve is also a plus. Just choose any pastel shadow and apply generously around your upper and lower lashes and make sure to line your eyes with a black pencil and top it off with some black mascara. There you have it, a surefire way to update your look for spring! *Images courtesy of elle.com . Graphics courtesy of Chic Intuition LLC.",
