                            "post_text_content": "November 11, 2008 | Tags: Celeb Chic The minute we spotted Lindsay on her latest cover for Harper’s Bazaar, we knew the girl was finally on track in her life. Aside from her weak acting rep, the girl is doing something right. Maybe like finally simmering down from the nightlife schedule she used to worship, and actually have time to eat a bite? Take a look at her Elle cover from a few years back, the dead eyes and extremely slim figure seem like representations of her dark past, but judging from her healthy image on HB, we see a bright future for this starlet. Go nutritional meals!! “I was going to clubs all the time, and it was not okay. I was so alone. It made me not focus on what I was doing . . . I was living here [at the Chateau Marmont] for almost two years. Who blows that much money on a hotel? I could have bought a house! I did it to myself, and I have to deal with the consequences. I’m thankful for what I can take out of it. Now I feel clear. That’s my past, and I’m a different person now. I have goals and I’m working to achieve them. I’m not hanging out with people who are out every night getting f-ed up. And — I think that I’m happy.” *Images courtesy of elle.com and popsugar.com . Graphics courtesy of Chic Intuition Inc.",
