                            "post_text_content": "August 3, 2009 | Tags: Chic Interview M ost 15 year olds are out partying or at the mall with their greatest achievement being an A on their latest math test. Not Kristin of prim. magazine. At 15, she is the founder and editor of her own fashion magazine with a recent viewership count of just under 130,000. In addition to seeing her cutting edge layouts and edgy designs in print, she has also had the honor to interview the likes of Rad Hourani. prim. is a publication which strives to showcase only the most cutting edge in fashion, music, and art and for her work, Kristin has been featured in French Glamour, Italian Elle, and Teen Vogue among others. On top of all that, she is absolutely beautiful and, in our humble opinion, mature well beyond her years. Check out our interview with Kristin below then head over to her amazing magazine here and prepare to be just as hooked on her as we are. Chic Intuition: Let’s start by saying we are absolutely dumbfounded. After seeing your magazine we were extremely impressed and the fact that you’re only 15 blew us away! What motivated you to start your own magazine at such a young age? And how did you get anyone to take you seriously? Kristin: I have always been driven by aesthetics; I am an absolute perfectionist when it comes to my image and how things look. For this reason, fashion and art began to consume my life. Instead of studying for math and science I found myself endlessly flipping through my abundant supply of fashion/art magazines. The idea to begin my own magazine came to me about a year and a half ago and I decided to run with it. It was a complete shot in the dark but it began to come together within a few months. At first no one took me seriously. I would tell people I ran a publication and their responses would be “that’s nice” or “aw, that’s cute.” I think as prim. began to really make its way around the web (and the print versions around the world) did people begin to realize I was absolutely taking it as seriously as anything. Chic Intuition: Do you spend most of your free time working? If so,ever long to drop the responsibility of running your own magazine to go out and party like other kids your age? Kristin: Well I think it is a misconception that I don’t have time to be with my friends. I don’t run the whole entire magazine myself; people write the articles, book the interviewees, find retailers, etc. I design the layouts and OK everything that is put on the pages. This does allow me to have a social life, which I do love. Sure sometimes I cannot go out because I am required to fulfill my responsibilities at prim., but it is actually pretty rare that I have to decline an invitation to do so. Chic Intuition: You attended your first fashion week this year. What was it like?Details please! Kristin: Attending NY Fashion Week was absolutely amazing! I got to sit front row at a number of shows and attend those which I never dreamt of ever seeing in person like Ports 1961 and Charlotte Ronson. At different points in the week I found myself sitting across from or next to the likes of Anna Wintour and Lindsay Lohan. I am pretty sure I attended around twenty shows throughout the week, but was unable to be there one full day because of a family obligation. It killed but I had to do it. Chic Intuition: Now to the fashion, we absolutely loved your latest issue! What was it like to score an interview with Rad Hourani? Kristin: Rad is an absolute genius; I was floored when he agreed to do an interview with prim. As a matter of fact I guess he liked the issue too because he invited us all to attend his fashion presentation for his diffusion line, Rad by Rad Hourani. It took place on the 28th here in NYC and it was amazing. You can check my blog for a first look at the collection. He truly is a master of his craft. Chic Intuition: Describe your personal style for our readers. Do you feel that you are now under pressure to always look good ever since you became an editor of a fashion magazine? Kristin: I definitely am a fusion of different styles, a little grunge and a little boho. I love studs, leather, lace, black, white, grays, etc. As a source recently described, a “perfect fusion of Alice Dellal and Mary-Kate Olsen” which I like very, very much. Being a magazine editor definitely did put a little pressure on the way I dressed, but not much really. I have always had to leave the house looking absolutely perfect so I don’t feel the pressure as much. Chic Intuition: What are this season’s top trends? Kristin: I definitely see a ton of harem pants, blazers, fringing, feathers, and pleats. I never follow trends; I don’t walk into stores looking to buy what’s “hot” so I often find myself being lost in a world of trendiness. I am surely not an expert when it comes to trends. Chic Intuition: What’s one trend that you think should be completely wiped off the face of the fashion world? Kristin: I hate neon. I saw a lot of it scattered here and there throughout various collections and I think the whole world would just do better without it simply because most people do not know how to wear it. I never wear neon; I don’t enjoy bright colors much at all. Chic Intuition: With running a fashion magazine already under your belt, where do you see yourself 10 years from now? Kristin: Hopefully still at prim., only it being ten times the size it is now. Chic Intuition: Finally, philosophical question time. How prim. is too prim.? Kristin: prim. is definitely a fashion magazine with edge. prim. being too prim. would be trying too hard to look edgy either by overdoing studs, leather, repeating shapes, or patterns. No one likes a poser.",
