                            "post_text_content": "September 3, 2008 | Tags: Celeb Chic , Chic Find , Chic Obsessions I’ve been admiring the name plate ring that LC has been donning since last season. I even read somewhere that she had them custom made at a posh Beverly Hills jeweler for her family and friends last Christmas. Ok, so you guys can tell that I googled “ Laruen Conrad’s ring ” and clicked away to try and find someone else who actually manufactures a similar double finger ‘ghetto’ ring as they call it. Well, I found one, and the price is not bad either! You can type in your name, ring size, and silver or gold preference, and viola! Now, I’m not going to directly link to them because, honestly, I’m not sure how legit the website is. But I promise you this, as soon as I get mine in the mail, I’ll be sure to give you guys a heads up! P.S. If you really want one, than just follow my lead and google it! But don’t hold us responsible for any mishaps! *Images courtesy of mtv.com . Graphics courtesy of Chic Intuition Inc.",
