                            "title": "Chic Interview: Danny Roberts",
                            "post_timestamp_parsed": "2008/09/29",
                            "post_timestamp_unparsed": "September 29, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/09/dannyinterview1.jpg", "http://www.chicintuition.com/wp-content/uploads/2008/09/dannyrotbers2.jpg"],
                            "post_text_content": "September 29, 2008 | Tags: Chic Interview One look at his sketches and we guarantee you’ll either be a) popping out the ol’ Crayola’s or b) get addicted to his blog. We have to admit that our lazy selves , in addition to our hectic schedules, have pleasantly allowed us to constantly admire his work at the comfort of our own desks. He’s young, talented, and into fashion; basically our kinda guy. Check out the interview below and then head on over to his blog . Chic Intuition: We find your artwork magnificent. The pieces are filled with emotion and utter beauty. When did you start sketching? Danny: Well… I’ve always loved to draw and sketch. I got my first sketch book in fourth grade, but I never was any good. It wasn’t until two and a half years ago, that I started to draw everyday and really work on getting good at it. Chic Intuition: Most of your work is based around fashion: models, fashion bloggers, designer ads. Any reason why? Danny: I like fashion a lot. I studied Fashion Design and that’s how I ended up doing Fashion Illustration, so I think that’s why Fashion is such a big part of my art. I draw models because they inspire me. I just started drawing fashion bloggers because I like fashion and as I click around fashion blogs, I would come across images that would inspire me or I would see images that just looked fun to draw. Almost all of the designer ads I draw or editorials are out of my character sketch book I started to practice drawing. Chic Intuition: How would you categorize your style? Danny: Not sure what I would categorize my style… to me, it’s just the way I draw. No matter how much practice and how much I try to draw things right, it just comes out in “my style” every time. Chic Intuition: What inspires you? Danny: Inspiration… wow. I would say just about everything. Music definitely inspires the mood of my drawing. I would have to say beautiful women are one of my biggest inspirations. They inspire me to try to capture there beauty on a piece of paper. Also, I love the 1920’s and old pictures. I use all theses things to inspire an idea. Chic Intuition : Who would your dream portrait model be and why? Danny: Hmm… that is a good question…. I would have to say Gemma Ward. There are a few reasons why, the first being that her facial feature have such an interesting look, so it always a great challenge trying to get the drawing right. The second reason, and I think the biggest reason, is she has an innocence and sincerity in her face and expressions that is one of the hardest things to capture with lines on a piece of paper, but on that rare occasion, if i can, it be comes poetry. Chic Intuition: We’re sure we’re going to get a lot of emails asking if you do commissioned work. Do spill if you do please!! Danny: Yes I do except offers to do portraits… but I do want to say I like to pick out the photo to draw. I have a pretty good pulse on what pictures would look cool in drawing form and what wouldn’t. So I really like an assortment of pictures to look through and find one that just feels right. For pricing, it would vary depending on the size, and other specifications the Client or individual is looking for. Chic Intuition: We noticed that you use various mediums to draw/paint. What’s your fave? Danny: Hmm…. well that’s a hard question cause my preference changes daily, haha, but I think my favorite which also is the one I feel most comfortable with is fine tip pens. That’s what I use the most, even when I sketch and doodle. I like it because it forces me to put down confident lines with out the possibility of erasing. Chic Intuition: And finally the philosophical q: how sketchy is too sketchy? Danny: When something with a clear message is covered up by distraction, at that point it becomes too sketchy. *Images courtesy of igorandandre.blogspot.com .",
