                            "post_url": "http://www.chicintuition.com/?p=3870",
                            "title": "Chic Interview: Francesca from Babooshka",
                            "post_timestamp_parsed": "2009/06/08",
                            "post_timestamp_unparsed": "June 8, 2009 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/06/babooshka.jpg"],
                            "post_text_content": "June 8, 2009 | Tags: Chic Interview Here are Chic Intuition, are aim is to scour between hundreds of up and coming designers, and to highlight the best of the best for our readers. A lot of aspects come to mind when selecting which designers we’d like to feature, but the two main elements that can make or break a potential interviewee are a) design innovation and b) reasonable price points. This next designer not only manages to fulfill our main requirements, but goes way and beyond. You’ve probably already heard of her, since 31 year old Francesca has quite a following in the blogosphere. Her etsy shop, Babooshka Boutique , just oozes edgy chic. Take a look at what she said, and then head on over to her shop . Chic Intuition: Ok, so let’s start with the obvious, what got you into fashion? Francesca: Since the day I could dress myself I always wore bizarre outfits. I always had a love for fashion and a serious shopping problem so I decided to change it into my career. I guess making it my career gave me more of an excuse to shop which in turn created the perfect anecdote for my poison. Went to design school and opened my first boutique immediately after I graduated. I knew I had to take a risk to get anywhere. Chic Intuition: How successful has Etsy been in launching your line? Would you recommend any fresh designers to create accounts there? Francecsa: My line was successful before etsy but once I closed my store I was sad that I would miss that interaction with the Babooskha customer. I continued to sell in boutiques but felt that with etsy I could have an outlet for that one on one interaction I crave. When I started posting my line on etsy last September I figured if anything it would be a place for me to test colors and designs to see their reaction from the general public but has since turned into a never ending queue of orders for people across the world. At this point I have shipped everywhere but Africa. Instead of being only sold in the US over 30% of my business is overseas. Chic Intuition: We love how a large influence in your collection are proportions. Your play with symmetry is genious and so ‘in’ these days. What inspired you to do so? Francesca : Since the first garment I designed I have never had a “slight” anything. I love drama and the trick it plays on the eye to pull off such volume while keeping the figure in mind. One of my first designs that I got to go “all out” on in school was a 27 yard chiffon maxi skirt. It was amazing tons of shirring and volume. I think I play on volume so much because everything with me is exaggerated. I love to test how far I can push something while still keeping it sell-able to the Babooshka customer. Chic Intuition: What future plans do you have for Babooshka? Fracesca: Top secret!! All I can say is keep your eyes and ears peeled! Chic Intuition: Can you give our readers a glimpse into any pieces your designing for your next collection? Francesca: More exaggeration, more drape, more leather, more asymmetry, with a splash of color and tuxedo tails. Chic Intuition: Finally, philosophical question time: how asymmetrical is too asymmetrical?! Francesca: I don’t think it is possible. As long as it is balanced out with the rest of the garment I am ready to push it as far as possible. Asymmetry and knits are the perfect marriage of two words to describe Babooshka… *Images courtesy of babooshkaboutique. Graphics courtesy of Chic Intuition LLC.",
