                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/08/pam-beasly.jpg"],
                            "post_text_content": "August 9, 2008 | Tags: Not Chic I’d like to take this opportunity (of having my own blog and all) to talk about a subject near and dear to my heart. A subject that, mind you, might offend the sensitive of the bunch (or those of you out there that follow this “trend”). Before starting, the trick of the trade, as you might have recognized from the title of the post and the images, is the oh so weird combination of blow dried bangs and curly hair. I know that a lot of you will excuse this habit by stating that it minimizes frizz, or gives a nice frame to the face. False. I think that you either have to choose to go curly or straight all the way, from start to finish & from root to end. Why not go natural, and let the curls run wild? I guarantee it’ll look much better than the 80s permed affect the half-half will give. Now I know the character of Pam Beesly from The Office is just playing the role of un -fashionista, rightfully displaying so in her hairstyle, but I didn’t want to place an actual photo and offend anyone (yes, if you google “perm” believe me, you will find pages of offenders). So to answer the equation above straightened bangs+curly hair= disaster! On a side note, I’m a huge fan of The Office, and this post is not aimed at dissing the show. Thought I’d just put it out there before the hate comments start pouring in *wink wink* *Images courtesy of bbc.co.uk ,and nbc.com . Graphics courtesy of Chic Intuition Inc.",
