                            "post_text_content": "August 4, 2009 | Tags: Chic Find I am flawed. But I’m not sure if the following is actually considered a flaw or a an attribute of good fortune. I care what people think. I care, that it sometimes influences my fashion choices. Don’t get it? Lets take the following example to heart. The moment I saw these jeans, by Shopbop ‘s latest exclusive line, Custom Denim , I freaked out. I loved the brilliance of of detail, but winced while imagining the public’s reaction. And by public, I include my own mother . Chic Critic thinks they are divine, and would totally pair them with a loose tee and booties. Question is, would you? Our stylists are a constant source of fashion inspiration here at Shopbop, so when they started showing up in jeans they had hand-destroyed to their exacting standards, an idea began to take shape: what if we launched a capsule line of limited-edition, one-of-a-kind denim pieces distressed on-site by our very own styling team? –Shopbop *Images courtesy of shopbop.com . Graphics courtesy of Chic Intuition LLC.",
