                            "post_text_content": "June 2, 2010 | Tags: Cheap Chic , Chic Picks We’re huge fans of Hermes. We’d love to sport one of their beauties, when we’ve reached a certain age of maturity and poise and actually have enough saved away that we can afford the splurge. What we hate? Knock-offs. We here at Chic Intuition have a saying, “If you can’t afford it, don’t sport it”. With that said, there’s nothing wrong with donning a bag with a similar…let’s call it ‘ aura ‘. We’ve all seen the messenger Hermes on their Fall 2010 runways, and we don’t need to ask their price. If you’d like a similar structured messenger for around $350, why not sport one of these Dooney & Bourke bags? We love the Alto saddle version or even the Amazon . They look so much more than their worth. I need to get my hands on one, only question is…which?! *Images courtesy of style.com and their respective links. Graphics courtesy of Chic Intuition LLC.",
