                            "title": "Mary Kate Olsen Makeup Chic",
                            "post_timestamp_parsed": "2010/02/25",
                            "post_timestamp_unparsed": "February 25, 2010 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2010/02/mary-kate-olsen-makeup-chic.jpg"],
                            "post_text_content": "February 25, 2010 | Tags: Celeb Chic While everyone admired MK’s outfit, jewelry over gloves, and shoes at the Burberry Prorsum show in London, I was too busy staring at her face! The girl is known for taking fashion risks and her brownish lipstick is no exception. I also thought lipliner was officially out but she makes it look so good! I decided to go on a mission to find a similar look and was able to do so courtesy of M·A·C. To get the look… Face: Apply M·A·C Studio Moisture Tint SPF 15 in Medium allover face and neck. Next, brush on some M·A·C Bronzing Powder in Golden. Eyes: Using the M·A·C ‘Spring Color Forecast’ Eyeshadow Kit , brush Manila Paper eyeshadow from lashline to browbone. Next apply the color Aztec onto crease. Finally, brush creole from lashline to crease and onto lower lashline. Line upper and lower lashlines with M·A·C Fluidline in Blacktrack and brush M·A·C Mascara X in Black X onto lashes. Lips: Now the most important part of her look! Apply M·A·C ‘All Ages, All Races, All Sexes’ Lipstick in Empowered onto lips. Finish off the look by lining your lips with M·A·C Lip Pencil in Stripdown. *Image courtesy of olsensanonymous.blogspot.com . Graphics courtesy of Chic Intuition LLC.",
