                            "post_text_content": "October 5, 2009 | Tags: Chic Review , Not Chic When we first heard that Lohan was appointed ‘Creative Director’ of Ungaro we were shocked to say the least. We know that actors and singers have smudged the line between entertainment and design (with numerous collaborations, both poor and gorge to support the aforementioned), but one of the most prestigious fashion houses hiring an actress with a track record of tardiness, drugs, alcohol, and pure drama seemed a bit reckless on Ungaro’s part. Don’t forget the fact that one of our personal faves, and youngest fashion talents out there, Esteban Cortazar coincidentally left the label as head designer when Lindsay’s job was made public, only adding salt to our wounds. So you can imagine our anticipation for their Spring 2010 show, and we can happily say we were pleased that our initial predictions were correct. The designs were amateur and the glittery pasties were cheesy and we could instantly see the brand slip away from the cooler and more modern direction that Esteban was taking it in. Do we believe Lindsay actually had a huge part to do with it? Not really. Do we think she was hired to create buzz for the Emanuel Ungaro line? Yes most definitely. Do we still think she needs help and seems a bit off? Take a look at her talking in the video below and decide yourselves.",
