                            "post_text_content": "July 23, 2008 | Tags: Not Chic Ever wished you had the budget to buy any item of clothing that you loved? Or had the thought that if you wear all designer and expensive clothing then you must look good? Well think again… Ugly Betty has made it very clear that it’s possible to wear Marc Jacobs, Tracy Reese, Alice and Olivia, and even See by Chloe and make them look absolutely hideous. Ever since the first episode aired we have all loved to watch in awe as Betty commits one fashion faux pas after another. Kind of like a train wreck where you don’t want to look but just can’t get yourself to turn away. After deciding to explore the sources of her clothing even further, once again, it became even more clear to me that Betty should be considered a fashion icon. Not in the sense that she is super stylish but because she is living and breathing proof that it’s not what you wear but how you wear it. Can’t wait for some more of her iconic looks in the seasons to come! *Images courtesy of ugly-is-in.com and people.com . Graphics courtesy of Chic Intution Inc.",
