                            "post_timestamp_parsed": "2008/10/28",
                            "post_timestamp_unparsed": "October 28, 2008 ",
                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2008/10/leeselooks-interview.jpg"],
                            "post_text_content": "October 28, 2008 | Tags: Chic Interview It takes a lot of guts to change majors in your last year , and pursue a degree in something you’re more passionate about. But that’s what our next Chic Interviewee, Lisa Holowaychuk, did. After realizing that her heart lied with fashion, she dumped her Social Work degree and headed towards Consumer Science with Specialization in Clothing Management. Not only does this Canadian beauty, who calls South Africa her home, have a lot to offer but her blog boasts a stylish sensibility like no other. Take a look at what she had to say: Chic Intuition: Why did you decide to start a blog? Lisa: Passion. Inspiration. Love. After months of toying with the idea and building up a ridiculous amount of blogs on my favorites tab, I knew my passions could not stay caged much longer… I witnessed such a brilliant community of bloggers and felt their energy and passions through the screen. I guess you could say it was contagious. Chic Intuition: If you were given the role of creating ‘Lisa’s Fashion Timeline’, how would you categorize each era? Lisa: Oh dear. If only I could attach pictures to these eras. You guys would have such a great laugh. Here is my wonderful journey through my ever-evolving style. Chic Intuition: On average, how long does is take you to put an outfit together? Lisa: I have to admit I do not really give it too much thought, so on average I would say about five minutes. Number one- weather, number 2- mood, number 3-occasion and number 4- inspiration (I have a cork board which houses my current clippings). So with that set, I simply pull out couple pieces and start from there. But on lazy days, it’s worn in boyfriend’s jeans and a plaid, 10 seconds flat! Chic Intuition: If you had to categorize your style, what would you call it? Lisa: Simplicity coupled with a lot of masculine influence (leather, baggy denims, button downs) and the forever feminine touch, which every female around the world interprets and expresses in their own unique way. Chic Intuition: One accessory you can’t live without. Lisa: Hands down a bag. It can be anything really: a clutch, shopper, satchel, messenger, briefcase… I love them all. Let’s admit it; we stash our life into these babies, so without them we would be lost. Chic Intuition: Does the outfit make the person, or the person makes the outfit? Lisa: Without a doubt the person makes the outfit. I know this has been said a gazillion times, but style genuinely comes from the inside. It does not matter if you’re wearing Gucci or Gap; if you don’t feel secure in who you are from within, you will never truly feel complete. Chic Intuition: And finally, philosophical question time: How dark is too dark? Lisa: If it is too dark to see a smile, then it is too dark. *Images courtesy of lesselooks.com . Graphics courtesy of Chic Intuition Inc.",
