                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2009/03/lela-rose.jpg"],
                            "post_text_content": "March 26, 2009 | Tags: Chic Poll As I walked through Bloomingdales one day, this Lela Rose dress caught my eye because it really reminded me of the H&M dress Michelle Obama wore awhile back. This made me think of a major question, is it possible that Lela Rose was inspired by H&M? And if so, do you guys think that it’s ok to be inspired by a $50 dress and revamp it into a $995 dress? I think not! I’ve only heard of mainstream designers taking high end label pieces and making them cheaper but in my opinion the opposite is not ok! Now, tell me, is it just me or do these two dresses look very similar??? How do you feel about knock-ups? *Image courtesy of nitrolicious.com . Graphics courtesy of Chic Intuition Inc.",
