                            "image_urls": ["http://www.chicintuition.com/wp-content/uploads/2010/04/MBFW-VIEW-COLUMBUS.jpg"],
                            "post_text_content": "April 29, 2010 | Tags: Uncategorized Like most of you know, the Fall 2010 collections were the last shows to take place at Bryant Park. After years of being the place to show at, IMG have decided to move north of Manhattan to Damrosch Park. The move to Lincoln Center has allowed IMG Fashion to unveil event upgrades such as modernized production capabilities for designers, digital services concurrent with the advanced needs of the 21st Century, better accessibility for attendees through both public and private transportation and great resources/facilities on-site and in the surrounding areas. We can’t wait to attend the first shows in September at the new venue. New beginnings, new adventures, new fashion!",
