                            "post_text_content": "March 31, 2011 | Tags: Chic Review Influencers from the worlds of fashion, art, philanthropy, business and entertainment came together on March 29th at Christie’s Bid to Save the Earth. The event kicked off with a live auction featuring fantasy auction packages followed by the Runway to Green fashion show and closed with a performance by Nicki Minaj. The runway show featured looks from over 25 designers including Prada, Gucci, Balenciaga, Burberry, Yves Saint Laurent, Marc Jacobs and Alexander McQueen, among others. The Runway to Green Collection is available on Net-a-Porter.com with a minimum of 10% of net-proceeds from the sale of each item will benefit Alliance of Climate Protection, Natural Resource Defense Council and United Nations Environmental Programme’s Billion Tree Campaign. Show your love to Earth and check it out! *Images courtesy of net-a-porter.com . Graphics courtesy of Chic Intuition LLC.",
