                            "post_text_content": "June 28, 2009 | Tags: Ask Chic Chic Reader Maddy writes: “Hi there, my birthday is coming up next week and I wanted to know what I should wear with a silver sequin t-shirt. I’m from Australia so it is winter at the moment. I added an image of the top I want to wear. Thanks so much. Looking forward to hearing from you. PS: Love your blog!” Well Maddy, first off thanks for the compliment, and secondly l.o.v.e the fact that you want to glimmer on your B-Day. Special occasions are the best times to don some sparkle, and we imagined your top with countless outfit options. It was quite hard, but we managed to filter it down to two options. The main theme was to add some black, since the sparkles are enough shine. Also, like you mentioned, it’s winter in Australia so throw on a leather biker jacket or a fitted blazer for warmth. You can opt to pair the tunic with leggings and colored pumps, or partially tuck it into a high-waisted skirt. Hope you like the options! *Images courtesy of net-a-porter.com . Graphics courtesy of Chic Intuition LLC.",
